INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20220215034030', 'USER-20220218110402', 'Pentingnya Pembangunan Desa dalam Pembangunan Nasional', '<p>Desa berdasarkan UU No. 6 Tahun 2014 merupakan kesatuan masyarakat hukum yang memiliki batas wilayah yang berwenang untuk mengatur dan mengurus urusan pemerintahan, kepentingan masyarakat setempat berdasarkan prakarsa masyarakat, hak asal-usul, dan/atau hak tradisional yang diakui dan dihormati dalam sistem pemerintahan Negara Kesatuan Republik Indonesia. Secara singkatnya desa merupakan kesatuan wilayah yang dihuni oleh masyarakat yang mempunyai sistem pemerintahannya sendiri. Total desa di Indonesia yaitu 73.670 desa<a href=\"https://www.masterplandesa.com/penataan-desa/pentingnya-pembangunan-desa-dalam-pembangunan-nasional/#_ftn1\" name=\"_ftnref1\">[1]</a>. Tak heran jika Menteri Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi menyatakan jika desa merupakan pembentuk Indonesia<a href=\"https://www.masterplandesa.com/penataan-desa/pentingnya-pembangunan-desa-dalam-pembangunan-nasional/#_ftn2\" name=\"_ftnref2\">[2]</a>.</p>\r\n\r\n<p>Desa berbeda dengan kota yang dinilai lebih maju dan berkembang. desa memiliki permasalahan yang lebih besar. Mulai dari kemiskinan yang lebih tinggi, kesehatan yang rendah, konsumsi masyarakat rendah, SDM rendah, sarana dan prasarana yang lebih sulit dibandingkan kota, dan tingkat pendidikan rendah. Saat ini di Indonesia terdapat 5.559 (7,55%) Desa Mandiri, 54.879 (74,49%) Desa Berkembang, dan 13.232 (17,96%) Desa Tertinggal<a href=\"https://www.masterplandesa.com/penataan-desa/pentingnya-pembangunan-desa-dalam-pembangunan-nasional/#_ftn3\" name=\"_ftnref3\">[3]</a>. Permasalahan yang ada ini dapat diatasi dengan adanya pembangunan di desa. Pembangunan yang dilakukan seharusnya tidak hanya terletak pada kesejahteraan dan kemakmuran masyarakat, namun harus lebih dari hal itu. Tujuan dari esai ini adalah untuk mendeskripsikan pentingnya pembangunan desa dalam pembangunan nasional.</p>\r\n\r\n<p>Konsep pembangunan berkelanjutan tampaknya menjadi hal yang menjanjikan. Dalam pembangunan berkelanjutan, aspek pembangunan bukan hanya mengarah pada masyarakat masa kini melainkan juga masyarakat di masa depan. Pembangunan berkelanjutan idealnya dapat mencakup berbagai aspek yang ada di masyarakat juga masyarakat desa. Berdasarkan UU No. 6 Tahun 2014 tentang Desa Pasal 78 (1), pembangunan desa, yaitu peningkatan pelayanan dasar, pembangunan dan pemeliharaan infrastruktur dan lingkungan, pengembangan ekonomi pertanian berskala produktif, pengembangan dan pemanfaatan teknologi tepat guna, dan peningkatan kualitas ketertiban dan ketenteraman masyarakat desa.</p>\r\n\r\n<p>Pembangunan berkelanjutan di desa saat ini menerapkan prinsip-prinsip SDGs (<em>Sustainable Development Goals</em>) Desa. SDGs Desa sendiri merupakan program turunan dari SDGs yang dikeluarkan oleh PBB, yang memiliki 17 tujuan atau&nbsp;<em>goals</em>. Oleh karena itu pembangunan yang menerapkan SDGs Desa, maka dapat membantu pencapaian pembangunan nasional berkelanjutan sesuai dengan Peraturan Presiden No. 59 Tahun 2017 tentang pelaksanaan pencapaian tujuan pembangunan berkelanjutan.</p>\r\n\r\n<p>Contoh desa yang menjadi desa percontohan berdasarkan Kementerian Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi, yaitu Desa Karanglo, Kabupaten Klaten yang berinovasi dengan menggunakan bahan sampah menjadi berbagai model tas<a href=\"https://www.masterplandesa.com/penataan-desa/pentingnya-pembangunan-desa-dalam-pembangunan-nasional/#_ftn4\" name=\"_ftnref4\">[4]</a>. Dengan inovasi yang dilakukan oleh masyarakat, bukan hanya meningkatkan pendapatan dari desa saja, melainkan juga berdampak baik pada lingkungan. Contoh lainnya yaitu Kampung Sira, di Kabupaten Sorong. Masyarakat Kampung Sira, melalui program air bersih dan penerangan tenaga surya yang didampingi oleh&nbsp;<em>GreenPeace&nbsp;</em>berhasil meningkatkan pendapatan masyarakat<a href=\"https://www.masterplandesa.com/penataan-desa/pentingnya-pembangunan-desa-dalam-pembangunan-nasional/#_ftn5\" name=\"_ftnref5\">[5]</a>. Penerapan dengan menggunakan tenaga surya merupakan salah satu cara untuk mengurangi penggunaan minyak bumi dan batu bara yang tidak baik untuk lingkungan.</p>\r\n\r\n<p>Desa merupakan bagian dari pemerintahan Negara Republik Indonesia. Dengan jumlah desa yang mencapai 73.670 di tahun 2019, sangat wajar jika pembangunan yang terjadi di desa merupakan dasar dari pembangunan nasional. Berbagai program pembangunan berkelanjutan dengan dasar SDGs juga sudah terbukti manfaatnya bagi desa. Desa bahkan berkontribusi 74% terhadap pencapaian SDGs nasional<a href=\"https://www.masterplandesa.com/penataan-desa/pentingnya-pembangunan-desa-dalam-pembangunan-nasional/#_ftn6\" name=\"_ftnref6\">[6]</a>. Pembangunan desa juga bukan semata-mata untuk meningkatkan pendapatan masyarakatnya saja, tetapi juga meningkat kualitas pendidikan, kesehatan, lingkungan, sumber daya masyarakat desa, atau berbagai poin dalam SDGs Nasional. (SDPA)</p>', 'pic_1683509452_pic_1647518643_Infrastruktur-pendukung-pertanian-memiliki-peran-vital-untuk-mewujudkan-desa-mandiri-pangan..jpg', 'pentingnya-pembangunan-desa-dalam-pembangunan-nasional-BRT-20220215034030', '2022-02-15', '2023-05-08', NULL),
('BRT-20220215034051', 'USER-20220218110402', 'Model Pembangunan Desa Terpadu', '<p>Para pendiri Negara kita Republik Indonesia tercinta dengan segala pemahamannya tentang kondisi Tanah Air Indonesia yang terdiri beribu &ndash; ribu pulau dan suku bangsa dengan bijak menempatkan kondisi Desa sebagai unsur Pemerintah terdepan. Struktur Pemerintahan sedemikian rupa memiliki semangat untuk menjadikan Desa sebagai pilar utama pembangunan bangsa, logikanya bila sekitar 80.000 desa di bumi pertiwi ini maju, mandiri, sejahtrera dan demokratis maka menjelmalah Negara Kesatuan Indonesia menjadi bangsa yang besar dan terhormat dalam percaturan bangsa &ndash; bangsa di dunia.</p>\r\n\r\n<p>Lain yang diharap lain pula kenyataannya, dengan pola sentralistik yang dikembangkan di masa lalu telah menempatkan desa menjadi &ldquo;pelengkap penderita&ldquo; yang tidak berdaya segalanya ditentukan dari atas bahkan cenderung segala potensi yang dimilikinya lebih banyak menjadi &ldquo;Upeti&ldquo; pada Pemerintah diatasnya. Desa tetap miskin bodoh dan abdi para pejabat diatasnya yang semakin rakus mengeksploitasi desa.</p>\r\n\r\n<p>Setelah berjalan lama mulai tumbuh akan kesadaran akan kekeliruan tersebut terutama setelah terbukti bahwa pola sentralistik hanya menghasilkan koruptor-koruptor dan kesenjangan sosial yang tajam antara pusat, daerah dan desa. Reformasi pola ini dirombak total dimana pola desentralisasi yang ditinggalkan akan dipacu kembali Undang-Undang Dasar 1945 yang telah diamandemen, kemudian lahir Undang-Undang Nomor 22 Tahun 1999 tentang Pemerintahan Daerah yang direvisi menjadi Undang-Undang Nomor 32 Tahun 2004 Tentang Pemerintahan Daerah yang semangatnya lebih berpihak pada desentralisasi dan demokratisasi. Kesulitan berhimpun dalam rangka membangun posisi tawar bagi pemerintahan desa telah punah.<br />\r\nSelama ini, kebijakan pembangunan di Indonesia terutama pembangunan Desa selalu bersipat top down dan sektoral dalam perencanaan serta implementasinya tidak terintegrasi, hal ini dapat dilihat dari program pemerintah pusat ( setiap departemen ) yang bersipat sektoral. Perencanaan disusun tanpa melibatkan sektor yang lain serta pemerintah daerah, hal lain yang menjadi permaslahan adalah tidak dicermatinya persoalan mendasar yang terjadi di daerah, sehingga formulasi strategi dan program menjadi tidak tepat.</p>\r\n\r\n<p>Berkaitan dengan kemiskinan, sebagaimana terinformasikan dalam data statistik, ternyata sebagian besar masyarakat miskin berada di desa, oleh karena itu, pembangunan sudah sewajarnya difokuskan di ddesa sebagai upaya mengatasi kemiskinan, Pembangunan selama ini, lebih banyak di arahkan di kota, hal ini menyebabkan aktivitas perekonomian, berpusat di kota, hal inilah yang menyebabkan terjadinya migrasi dari desa ke kota. Masyarakat desa dengan segala keterbatasan pindah ke kota mengadu nasib dan sebagian besar dari mereka menjadi persoalan besar di kota.</p>\r\n\r\n<p>Disisi lain, kondisi di desa tidak tersentuh pembangunan secara utuh, infrastruktur dasar tidak terpenuhi, aktivitas ekonomi sangat rendah, peluang usaha juga rendah, sarana pendidikan terbatas, sebagian besar baru terpenuhi untuk sekolah dasar saja, Kondisi ini menyebabkan tidak ada pilihan lain bagi masyarakat desa untuk merubah nasibnya, yaitu dengan merantau ke kota.<br />\r\nPada kenyataannya, seluruh potensi sumber daya alam, sebagai raw material aktivitas penunjang perekonomian bisa dilaksanakan tanpa ada support bahan baku yang diproduksi di desa. Kondisi ini yang harus segera diselesaikan melalui strategi pembangunan desa yang tepat dan teritegrasi.<br />\r\nFakta lain memperlihatkan ekploitasi sumber daya alam di desa secara besar besaran, dengan tidak mencermati daya dukung lingkungan serta tidak melibatkan masyarakat setempat, dengan alasan kemampuan rendah dari masyarakat setempat, menyebabkan kerusakan lingkungan, baik fisik maupun sosial. Kondisi lingkungan menjadi rusak, demikian juga terjadi trasformasi kultur secara negatif, sebagai akibat masuknya para pendatang baru yang menyebabkan strategi pembangunan dalam mengatasi kemiskinan tidak akan berhasil apabila tidak diintegrasikan dalam kebijakan pembangunan berkelanjutanyang secara sadar merubah pola konsumsi masyarakat dan cara-cara produksi yang tidak menunjang keberlanjutan sumber daya alam dan lingkungan hidup.</p>', 'pic_1683509479_pic_1647518894_Aerial_view_of_Bajra_Sandhi_Monument_Denpasar_Bali_Indonesia.jpg', 'model-pembangunan-desa-terpadu-BRT-20220215034051', '2022-02-15', '2023-05-08', NULL),
('BRT-20220215040107', 'USER-20220218110402', 'Dibangun Lewat Swadaya Masyarakat, Desa Wisata Sindangkasih Garut Mampu Hidupi Warga.', '<p>Namun tidak demikian dengan warga Kampung Sindangkasih, Desa Sukamaju, Kecamatan Cilawu. Sebab, mereka berhasil membangun desa wisata yang dinamai Sindangkasih dari hasil gotong royong. Desa wisata Sindangkasih menawarkan berbagai paket wisata dari mulai river tubing di Sungai Ciwulan yang berhulu di Gunung Cikuray dan bermuara di Pantai Selatan Kabupaten Tasikmalaya, hingga wisata sejarah dengan mengunjungi bunker dan goa peninggalan masa penjajahan. &ldquo;Warga kampung ini memang sejak lama terkenal dengan gotong royongnya, mereka sampai punya koperasi dengan aset sampai Rp 300 juta,&rdquo; jelas Asep Edwin, Kepala Desa Sukamaju Kecamatan Cilawu saat ditemui di Desa Wisata Sindangkasih, pekan lalu.<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href=\"https://www.kompas.com/\">Kompas.com</a>&nbsp;dengan judul &quot;Dibangun Lewat Swadaya Masyarakat, Desa Wisata Sindangkasih Garut Mampu Hidupi Warga&quot;, Klik untuk baca:&nbsp;<a href=\"https://bandung.kompas.com/read/2022/01/21/165622178/dibangun-lewat-swadaya-masyarakat-desa-wisata-sindangkasih-garut-mampu\">https://bandung.kompas.com/read/2022/01/21/165622178/dibangun-lewat-swadaya-masyarakat-desa-wisata-sindangkasih-garut-mampu</a>.<br />\r\nPenulis : Kontributor Garut, Ari Maulana Karang<br />\r\nEditor : Gloria Setyvani Putri<br />\r\n<br />\r\nDownload aplikasi&nbsp;<a href=\"https://www.kompas.com/\">Kompas.com</a>&nbsp;untuk akses berita lebih mudah dan cepat:<br />\r\nAndroid:&nbsp;<a href=\"https://bit.ly/3g85pkA\">https://bit.ly/3g85pkA</a><br />\r\niOS:&nbsp;<a href=\"https://apple.co/3hXWJ0L\">https://apple.co/3hXWJ0L</a></p>', 'pic_1647519012_61ea5afce69c1.jpg', 'dibangun-lewat-swadaya-masyarakat-desa-wisata-sindangkasih-garut-mampu-hidupi-warga-BRT-20220215040107', '2022-02-15', '2023-05-08', '2023-05-08'),
('BRT-20220215040419', 'USER-20220218110402', 'MASYARAKAT JUK AYAQ CURHAT MASALAH PEMBANGUNAN DESA', '<p>Masyarakat bersama Staf Adat Juk ayaq, Kecamatan Telen, Kabupaten Kutai Timur berkunjung ke Kantor Dinas Pemberdayaan Masyarakat dan Pemerintahan Desa (DPMPD) Kaltim, Senin (23/3).</p>\r\n\r\n<p>Kedatangan mereka untuk curhat masalah pembangunan desa yang terjadi di desa mereka seiring terjadi masalah hukum pada Kepala Desa Juk Ayak.</p>\r\n\r\n<p>&ldquo;Prinsipnya mereka ingin minta solusi terkait masalah desa. Pembangunan desa terhenti sejak terjadi masalah hukum pada kepala desa mereka,&rdquo; sebut Kepala DPMPD Kaltim, Moh Jauhar Efendi saat menerima kunjungan.</p>\r\n\r\n<p>Masyarakat menginginkan pembangunan desa tetap berjalan sesuai perencanaan yang ditetapkan, sehingga infrastruktur dasar masyarakat terpenuhi dan ekonomi tetap berjalan.</p>\r\n\r\n<p>Sejalan dengan itu, Jauhar sudah memfasilitasi komunikasi dan koordinasi dengan Pemkab Kutai Timur. Dia sudah menghubungi Asisten Pemerintahan dan Kesra Sekab Kutai Timur menyampaikan permasalahan tersebut untuk dibantu penyelesaiannya. Dan asisten menjanjikan siap menerima audiensi sebelum mereka kembali ke Kampung Juk Ayaq.</p>\r\n\r\n<p>Setidaknya segera memerintahkan Camat Telen untuk menunjuk Pj Kepala Desa Juk Ayaq menggantikan Kepala Desa yang ada agar bisa melanjutkan penyelenggaraan pemerintahan dan pelaksanaan pembangunan.&nbsp;&nbsp;Sebab status Kepala Desa yang ada sudah ditetapkan sebagai tersangka karena masalah pengelolaan Dana Desa.</p>\r\n\r\n<p>Diketahui, kondisi perkembangan Kampung Juk Ayaq diantaranya belum mencapainya laporan rata - rata realisasi penyerapan sampai dengan 75 persen dan capaian output belum mencapai 50 persen.</p>\r\n\r\n<p>Kemudian Kepala Desa sudah berstatus tersangka, perlu proses penyelesaikan proses inputan siskudes 2020, Perdes APBDES 2020. Tenaga Pendamping Profesional (TPP) sudah membuat Rencana Kerja Tindak Lanjut (RKTL) berupa pendampingan Penyusunan APBDes 2020, untuk ditetapkan sebagai perdes APBdes 2020.</p>\r\n\r\n<p>Jauhar menerima kunjungan didampingi Kabid Pembangunan Desa dan Kawasan Perdesaan, Riani Tisnadewi beserta Kasi Pembangunan Desa, Isnawati, Kabid Pemberdayaan kelembagaan dan Sosbudmasy, Isnaini Trikorawati, dan Kabid Usaha Ekonomi Masyarakat, SDA, dan Teknologi Tepat Guna, Elvis. Nampak hadir Ketua Prodi Ilmu Pemerintahan FISIP Unmul Samarinda, Iman Surya, dan Tim Leader KPW Kaltim, Alwani.<strong>(DPMPD Kaltim/arf)</strong></p>', 'pic_1647519102_medium_23-03-2020-12-22-23-7650.jpg', 'masyarakat-juk-ayaq-curhat-masalah-pembangunan-desa-BRT-20220215040419', '2022-02-15', '2023-05-08', '2023-05-08'),
('BRT-20220316111248', 'USER-20220218110402', 'Ketua Lembaga Kredit Adat Gulingan Bali Jadi Tersangka Korupsi Rp 30,9 M', '<p>Dedy mengungkapkan, dugaan korupsi tersebut berawal dari adanya pengaduan nasabah LPD Desa Adat Gulingan yang tidak bisa menarik tabungannya. Polres Badung melalui Unit Tindak Pidana Korupsi sekitar Mei 2021 kemudian melakukan penyelidikan untuk memastikan kebenaran informasi tersebut.<br />\r\n<br />\r\n&quot;Berdasarkan hasil penyelidikan ditemukan peristiwa pidana dan berdasarkan hasil audit ditemukan kerugian sebesar Rp 30.922.440.294 (30,9 miliar). Selanjutnya dilakukan gelar perkara dan disepakati statusnya ditingkatkan ke tahap penyidikan,&quot; terang Dedy.<br />\r\n<br />\r\nPihaknya kemudian mulai melakukan penyidikan terhadap RD pada 25 Oktober 2021. Total ada sebanyak 39 orang yang diperiksa mulai dari saksi ahli hingga terlapor RD.<br />\r\n<br />\r\n&quot;Dari hasil pemeriksaan saksi-saksi dan ahli, ditemukan fakta-fakta bahwa timbulnya kerugian terhadap LPD Desa Adat Gulingan disebabkan adanya penyimpangan yang dilakukan RD dan kawan-kawan,&quot; ungkap Dedy.<br />\r\n<br />\r\nBaca artikel detiknews, &quot;Ketua Lembaga Kredit Adat Gulingan Bali Jadi Tersangka Korupsi Rp 30,9 M&quot; selengkapnya&nbsp;<a href=\"https://news.detik.com/berita/d-5960778/ketua-lembaga-kredit-adat-gulingan-bali-jadi-tersangka-korupsi-rp-309-m\">https://news.detik.com/berita/d-5960778/ketua-lembaga-kredit-adat-gulingan-bali-jadi-tersangka-korupsi-rp-309-m</a>.<br />\r\n<br />\r\nDownload Apps Detikcom Sekarang https://apps.detik.com/detik/</p>', 'pic_1647429168_jalan.jpg', 'ketua-lembaga-kredit-adat-gulingan-bali-jadi-tersangka-korupsi-rp-30-9-m-BRT-20220316111248', '2022-03-16', '2023-05-08', '2023-05-08'),
('BRT-20220823134515', 'USER-20220218110402', 'Bupati Tabanan Hadiri Rangkaian Kegiatan HUT RI ke 77 dan HUT Desa Gubug ke 101', '<p>Bupati Tabanan, Dr. I Komang Gede Sanjaya, S.E., M.M hadir secara langsung untuk membuka secara resmi rangkaian kegiatan peringatan HUT RI ke -77 dan HUT Desa Gubug ke 101, hari sabtu, 13 agustus 2022. Dalam acara tersebut juga turut hadir Anggota DPR RI Drs. I Made Urip M.Si, Ketua DPRD Kabupaten Tabanan, Sekda Tabanan, Asisten II, Kepala Perangkat Daerah terkait di lingkungan Setda Tabanan, Camat Tabanan, Kepala Desa se Kecamatan Tabanan, Bendesa Adat Bedha dan tokoh masyarakat Desa Gubug.</p>\r\n\r\n<p>Kedatangan jajaran Pemkab Tabanan malam hari itu disambut dengan meriah penuh antusias &nbsp;oleh masyarkat Desa Gubug. Bahkan begitu menapak di depan kantor Desa Gubug disambut dengan baleganjur dan tarian Hanoman dan Anggada oleh Karang Taruna Desa Gubug sembari mengalungkan bunga pada Bupati. &nbsp;Selanjutnya Bupati berjalan diiringi oleh Hanoman dan Anggada menuju lapangan desa untuk meninjau Stand Pameran dan Promosi IKM dari banjar se Desa Gubug dan BUMDesa se Kecamatan Tabanan.</p>\r\n\r\n<p>Dalam rangkaian acara, selain menyanyikan lagu kebangsaan Indonesia Raya, juga dinyanyikan Lagu Mars &nbsp;dan Hymne Desa Gubug yang dinyanyikan oleh TP PKK Desa Gubug dengan penuh semangat dan sangat memukau dan mengesankan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ketua Panitia Pelaksana HUT RI 77 dan HUT Desa Gubug 101, dalam laporanya Ni Made Yudani, mengungkapkan bahwa Rangkaian kegiatan peringatan HUT RI dan Desa Gubug, sengaja direncanakan dan dilaksanakan sedemikian rupa karena selama dua tahun Desa Gubug tidak memperingati HUT akibat dari vandemi covid-19. Jadi ada kerinduan bagi masyarakat Gubug, disamping beberapa hal yang ingin dicapai dalam pelaksanaanya. Mengingat dua tahun terakhir ini tatanan Kesehatan, sosial dan ekonomi masyarakat &nbsp;telah terpuruk, yang sentiasa ingin dipulihkan dan dibangkitkan agar dapat seperti dulu sebelum adanya vandemi covid-19 bahkan agar lebih kuat sehingga kesejahteraan, kemanmdirian masyarakat yang berbudaya lebih cepat terwujud. Tak lupa Ni Made Yudani juga berterima kasih atas dukungan Bupati Tabanan dan seluruh pihak lainya hingga terselenggaranya acara ini.</p>\r\n\r\n<p>Dalam sambutannya Bupati Tabanan, tentunya sangat mengapresiasi kegiatan yang sekaligus dirangkaikan dalam semarak kemerdekaan ini. Di kesempatan itu, Sanjaya juga menceritakan sejarah Desa Gubug dan Kabupaten Tabanan mulai dari terbentuknya hingga hari peringatan ulang tahunnya yang ke 101 tersebut. &ldquo;Patut kita bangga, Desa Gubug ini sudah berdiri sejak 101 tahun lalu, luar biasa&rdquo; Ujarnya. Pihaknya juga memberikan pujian terhadap Mars dan Hymne Desa Gubug yang dinyanyikan oleh TP PKK Desa Gubug, pada malam hari itu, hal seperti ini bisa menjadi contoh bahkan di pemerintah kabupaten Tabanan dan Desa-desa lainnya di Kabupaten Tabanan, &nbsp;baginya, pembangunan dari Desa sangat penting, oleh sebab itu komitmen</p>\r\n\r\n<p>pemkab Tabanan untuk berkantor di desa secara konsisten terus dilakukan. Hal tersebut dikatakannya, untuk melihat potensi-potensi masing-masing Desa yang dapat dikembangkan, demi mempercepat tercapainya Visi dan Misi Tabanan yang Aman, Unggul dan Madani (AUM). &ldquo;Banggalah menjadi masyarakat Tabanan&rdquo; tagline yang terus ditegaskannya, agar senantiasa terbangun spirit di dalam diri masyarakat, untuk terus bersama-sama pemerintah, membangun dari Desa.&nbsp;</p>\r\n\r\n<p>Terlebih, dalam perayaan HUT ini, Desa Gubug juga menggandeng IKM dan UMKM se-Desa untuk turut berpartisipasi, berpromosi dan berjualan. &ldquo;Saya perlu memberikan apresiasi yang sebesar-besarnya, ini adalah wahana yang memberikan ruang gerak kepada IKM dan UMKM saat kita mengalami dampak pandemi, wujud pembangunan dari kita, oleh kita dan untuk kita, sangat bermanfaat. Kalau kita ikut berperan dan berpartisipasi, roda perekonomian ini akan terus berputar, ini adalah harapan kita&rdquo; tegasnya.&nbsp;&nbsp;</p>\r\n\r\n<p>Pelaksanaan rangkaian kegiatan telah dimulai sejak 1 agustus sampai puncaknya di 18 Agustus mendatang. Dengan melibatkan IKM dan UMKM Se-Desa Gubug dan Bumdesa se-Kecamatan Tabanan, jalan santai, beragam lomba oleh ibu-ibu PKK, siswa siswi SD se-Desa Gubug, Karang Taruna dan Lansia Desa Gubug &ldquo;Kegiatan ini selain menyemarakkan kemerdekaan Indonesia yang ke-77 dan juga peringatan HUT Desa Gubug yang ke 101 memiliki tujuan untuk mengangkat, memaksimalkan potensi yang dimiliki desa dan tujuan khusus sebagai sarana sosialisasi kemajuan dan keberhasilan pembangunan dan sebagai sarana edukasi dalam rangka meningkatkan apresiasi masyarakat&rdquo; Kegiatan ditandai dengan pemukulan gong &nbsp;oleh Bupati Sanjaya.didampingi oleh Ketua DPRD Kabupaten Tabanan, Drs. I Made Urip, Sekda Tabanan, Perbekel Desa Gubug dan Panitia Pelaksana HUT RI dan HUT Desa Gubug yang diringi suara kembang api yang bergemuruh di udara.</p>\r\n\r\n<p><strong><strong>Penulis : @51</strong></strong></p>', 'pic_1683509372_pic_1661262416_gbr.jpg', 'bupati-tabanan-hadiri-rangkaian-kegiatan-hut-ri-ke-77-dan-hut-desa-gubug-ke-101-BRT-20220823134515', '2022-08-23', '2023-05-08', NULL),
('BRT-20220823135102', 'USER-20220218110402', 'SEJUMLAH HADIAH, PENGHARGAAN DAN UCAPAN TERIMA KASIH DISERAHKAN DALAM PERAYAAN HUT DESA GUBUG KE 101', '<p>Kepala Dinas PMD Kabupaten Tabanan menghadiri Peringatan HUT Desa Gubug, acara tersebut sebelumnya didahului dengan berbagai kegiatan yang dirangkai dengan kegiatan peringatan HUT RI ke 77, seperti Pameran dan Promosi Produk IKM dan UMKM yang ada di Desa Gubug dan BUMDesa se Kecamatan Tabanan, gerak jalan santai, lomba olah raga PKK, lomba menyanyi dari PKK, Lomba olah raga siswa siswi SD se Desa Gubug, Fun Bike, Pawai Obor dan lain-lain.</p>\r\n\r\n<p>Bertempat di lapangan Desa Gubug, warga setempat menyambut dengan penuh semangat dan antusias HUT ke 101 Desa Gubug yang dihadiri langsung oleh Kepala Dinas PMD Kabupaten Tabanan, I GA Supartiwi yang didampingi oleh Camat Tabanan, Perbekel se kecamatan Tabanan beserta ketua TP PKK Desa se Kecamatan Tabanan.</p>\r\n\r\n<p>Acar diawali dengan menyanyikan lagu Indonesia Raya yang dilanjutkan dengan lagu Mars Desa Gubug. Selanjutnya Doa yang dirangkai dengan Renungan Suci, dimana lampu dimatikan, penerangan hanya menggunakan obor yang jumlahnya 18 buah menambah khusuknya suasana.</p>\r\n\r\n<p>Ketua BPD Desa Gubug I Wayan Suwitra, &nbsp;mengucapkan terima kasih yang sedalam dalamnya kepada Panitia Pelaksana dan sekaligus mengajak seluruh masyarakat Gubug untuk Bangga menjadi warga Gubug. &nbsp;Untuk bangga menjadi warga Gubug maka sangat dibutuhkan dedikasi, pengabdian kepada Desa walaupun mungkin tidak bermafaat bagi orang banyak dari pada tidak berbuat sama sekali. Hal ini penting ditumbuhkan dalam setiap insan demi kemajuan Desa Gubug. &nbsp;</p>\r\n\r\n<p>Selanjutnya perbekel Desa Gubug I Nengah Mawan, mengucapkan selamat datang dan selamat malam kepada selurun &nbsp;undangan dan yang hadir. Sembari</p>\r\n\r\n<p>memberikan Apreisasi dan terima kasih kepada Panitia Pelaksana HUT RI dan HUT Desa Gubug yang telah bekerja Keras, bekerja Cerdas, bekerja Ikhlas dan Bekerja Tuntas sehingga kegiatan dapat terlaksana dengan lancar dan sukses. Disamping itu ucapan terima kasih juga disampaikan kepada Pemerintah Kabupaten Tabanan melalui Kepala Dinas PMD dan Camat Tabanan yang selama ini telah banyak memberikan pembinaan, petunjuk dan arahan sehingga pemerintah Desa Gubug dapat berjalan dengan baik, demikian pula halnya kepada para Perbekel se-Kecamatan Tabanan atas dorongan, motifasi dan partisifasi dan Kekompakanya selama ini. Ucapan Terima kasih juga disampaikan kepada para Donatur dan Seluruh masyarakat Desa Gubug atas semangat dan antusiasnya dalam setiap program yang dicanangkan oleh pemerintah Desa.</p>\r\n\r\n<p>Mawan, mengajak seluruh masyarakat &ldquo;Marilah membangun Desa dengan&nbsp;memgembangkan cara-cara baru, meninggalkan kebiasaan lama yang tidak sesuai dengan hikmah yang kita dapatkan dari vandemi-covid 19, dan kita harus berani menerobos ketidakmungkinan. &nbsp;&nbsp;Karena kita akan &nbsp;dipaksa untuk membangun normalitas baru dan melakukan hal-hal yang dianggap tabu selama ini. Memasuki &nbsp;101 tahun Desa Gubug &nbsp;mari kita jadikan momentum untuk introspeksi marilah secara Bersama sama melaksanakan &nbsp;arah pembangunan dan mengambil sikap guna membentuk dan membangun pondasi-pondasi dalam rangka mempercepat terwujudnya kesejahtraan , kemajuan dan kemakmuran Desa Gubug, hingga menjadi Desa yang &nbsp;Sejahtera, Mandiri, &nbsp;dan Berbudaya, pada suatu saat nanti terwujud Desa Gubug yang EMAS,<strong>&nbsp;</strong>Kami sadari bahwa hal tersebut tidak akan dengan mudah terwujud, hambatan dan rintangan pasti akan ada. &nbsp;</p>\r\n\r\n<p>Dalam kegiatan ini juga diserahkan berbagai hadiah, penghargaan dan ucapan terima kasih.</p>\r\n\r\n<p><strong>Adapun hadiah diberikan kepada :</strong></p>\r\n\r\n<p>Lomba Posyandu Balita se Desa Gubug :</p>\r\n\r\n<ul>\r\n	<li>JUARA 1 : POS YANDU BOUGENVILE DUSUN PANDE</li>\r\n	<li>JUARA 2 : POS YANDU ADENIUM DUSUN CURAH</li>\r\n	<li>JUARA 3 : POS YANDU MAWAR DUSUN TAMAN</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Lomba PKK se Desa Gubug :</p>\r\n\r\n<ul>\r\n	<li>JUARA 1 : PKK DUSUN TONJA</li>\r\n	<li>JUARA 2 : PKK DUSUN CURAH</li>\r\n	<li>JUARA 3 : PKK DUSUN GUBUG BELODAN</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Penghargaan Diberikan kepada :</strong></strong></p>\r\n\r\n<ol>\r\n	<li>&nbsp;I Wayan Purnawan dalam bidang olah raga Silat</li>\r\n	<li>I Ketut Fajar Naranatha Sukanadi dalam bidang seni dan budaya</li>\r\n	<li>I Nyoman Sutama dalam bidang kebersihan Desa</li>\r\n	<li>Ni Gusti Ayu Purnama Dewi, anak keluarga RTM, Siswa SD.N No. 2 Gubug</li>\r\n	<li>Gusti Ayu Putu Widia Ratih Maharani, anak keluarga RTM, siswa SD.N No. 1 Gubug</li>\r\n	<li>Ni Komang Mirah Utami Dewi, Anak Keluarga RTM, siswa SMA</li>\r\n	<li>Gusti Pandu Darma Santika, anak RTM, siswa SMP N 3 Tabanan</li>\r\n	<li>BUMDesa Purwa Melanting Desa Denbantas, sebagai stand BUMDesa Pavorit</li>\r\n	<li>Dusun Curah Desa Gubug, sebagai stand terbaik</li>\r\n</ol>\r\n\r\n<p><strong>Ucapan terima kasih diberikan kepada :</strong></p>\r\n\r\n<ol>\r\n	<li>UPK Kecamatan Tabanan</li>\r\n	<li>BUMDesa Tunjung Sari desa Tunjuk</li>\r\n	<li>BUMDesa Cemara Desa Dajan Peken</li>\r\n	<li>BUMDesa Amertha Sari Desa Buahan</li>\r\n	<li>BUMDesa Catur Amertha Nadi Desa Subamia</li>\r\n	<li>BUMDesa Sekar Sandat Desa Sesandan</li>\r\n	<li>BUMDesa Tri Semaya Jati Desa Gubug</li>\r\n	<li>BUMDesa Wijaya Kusuma Desa Delod Peken</li>\r\n	<li>BUMDesa Purwa Melanting Desa Denbantas</li>\r\n	<li>Stan Dinas Pertanian Kabupaten Tabanan</li>\r\n</ol>\r\n\r\n<p><strong>Bingkisan diberikan kepada :</strong></p>\r\n\r\n<ol>\r\n	<li>Keluarga I Gusti Agung Wayan Geria (Perbekel Desa Gubug I)</li>\r\n	<li>Keluarga I Gusti Agung Wayan Kerug (Perbekel Desa Gubug II)</li>\r\n	<li>Keluarga I Gede Mergog (Perbekel Desa Gubug III)</li>\r\n	<li>Keluarga I Gusti Made Dendi (Perbekel Desa Gubug IV)</li>\r\n	<li>I Gusti Nyoman Supartha (Perbekel Desa Gubug V)</li>\r\n	<li>I Wayan Suwitra. SH (Perbekel Desa Gubug VI)</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam kesempatan tersebut Kadis PMD mengucapkan selamat HUT RI ke 77 dan HUT Desa Gubug Ke 101. &nbsp;Saya atas nama pribadi dan pemerintah kabupaten Tabanan mengucapkan selamat Hari Ulang Tahun Negara Republik Indonesia &nbsp;ke 77 dan Hari Ulang Tahun Desa Gubug ke 101, semoga di tahun &nbsp;ini dengan melandainya covid-19 kita bisa lebih pesat lagi dalam berbagai bidang namun tentu perlu adanya sinergitas dengan berbagai pihak.</p>\r\n\r\n<p>Kepala Dinas PMD Kabupaten Tabanan mengapresiasi apa yang dilakukan oleh Desa Gubug dalam memperingati HUT RI dan HUT Desa Gubug. Kegiatannya cukup banyak dan sangat meeriah. &nbsp;Terlebih lebih Gubug sudah mempunyai lagu Mars dan Hymne Desa termasuk memiliki hari jadi Desa Gubug, seperti yang disampaikan oleh Perbekel Desa Gubug tadi. &nbsp;Sejarah Desa harus setiap saat disampaikan dan didengungkan kepada masyarakat, agar masyarakat Desa semua tahu akan sejarah Desanya yang diharapkan dapat menambah kecintaanya terhadap Desa. &nbsp;Mengenai sejarah desa dan perkembangan desa Gubug dari waktu ke waktu dapat didokumentasi dalam system Informasi Desa, agar tersimpan lebih baik dan aman dan dapat dibuka dan dipelajari oleh semua orang terutama generasi muda kita. Lagi sekali Kepala Dinas PMD memberikan apresiasi dan seraya menutup rangkaian peringatan HUT RI ke 77 dan HUT desa Gubug ke 101, secara resmi dengan pelepasan burung didampingi oleh Camat Tabanan dan &nbsp;Perbekel se-Kecamatan Tabanan<strong><strong>.</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Penulis : @51</strong></strong></p>', 'pic_1683509400_pic_1661262662_gbr2.jpg', 'sejumlah-hadiah-penghargaan-dan-ucapan-terima-kasih-diserahkan-dalam-perayaan-hut-desa-gubug-ke-101-BRT-20220823135102', '2022-08-23', '2023-05-08', NULL),
('BRT-20220831010118', 'USER-20220218110402', 'Rangkaian Kegiatan Lomba HUT RI ke-77 dan HUT Desa Gubug ke-101', '<p>Pelaksanaan rangkaian kegiatan telah dilaksanakan mulai dari 1 Agustus 2022 sampai puncaknya pada tanggal 18 Agustus 2022 dengan melibatkan IKM dan UMKM Se-Desa Gubug dan Bumdes se-Kecamatan Tabanan. Adapun kegiatan lomba di Desa Gubung dalam rangka HUT Desa Gubug yang ke 101 yaitu jalan santai, fun bike, lomba karaoke. Kegiatan lomba dalam menyambut HUT RI ke 77 yaitu lomba balap karung, lomba ngulat tipat bergoyang, lomba balon berpasangan, lomba mengkap belut dan lomba makan kerupuk. Dalam lomba &ndash; lomba tersebut&nbsp; melibatkan seluruh warga Desa Gubug, murid &ndash; murid Sekolah Dasar yang berada di Desa Gubug serta para guru pun ikut semangat dan sangat berantusias untuk menyambut HUT Desa Gubug ke 101 dan HUT RI ke 77.</p>', 'pic_1682257040_img.jpeg', 'rangkaian-kegiatan-lomba-hut-ri-ke-77-dan-hut-desa-gubug-ke-101-BRT-20220831010118', '2022-08-31', '2023-04-23', NULL),
('BRT-20220831045544', 'USER-20220218110402', 'Rangkaian Kegiatan Lomba HUT RI ke-77 dan HUT Desa Gubug ke-101', '<p>Pelaksanaan rangkaian kegiatan telah dilaksanakan mulai dari 1 Agustus 2022 sampai puncaknya pada tanggal 18 Agustus 2022 dengan melibatkan IKM dan UMKM Se-Desa Gubug dan Bumdes se-Kecamatan Tabanan. Adapun kegiatan lomba di Desa Gubung dalam rangka HUT Desa Gubug yang ke 101 yaitu jalan santai, fun bike, lomba karaoke. Kegiatan lomba dalam menyambut HUT RI ke 77 yaitu lomba balap karung, lomba ngulat tipat bergoyang, lomba balon berpasangan, lomba mengkap belut dan lomba makan kerupuk. Dalam lomba &ndash; lomba tersebut&nbsp; melibatkan seluruh warga Desa Gubug, murid &ndash; murid Sekolah Dasar yang berada di Desa Gubug serta para guru pun ikut semangat dan sangat berantusias untuk menyambut HUT Desa Gubug ke 101 dan HUT RI ke 77.</p>\r\n\r\n<p>Pada hari minggu, 14 Agustus 2022 pagi bertempat di Lapangan Desa Gubug Tabanan melaksanakan lomba hari pertama yaitu lomba jalan santai yang dimeriahkan oleh warga Desa Gubug mulai dari anak &ndash; anak, pemuda pemudi, bapak ibu, bahkan tidak sedikt lansia yang mengikutinya.</p>\r\n\r\n<p>Acara diawali dengan pemanasan dengan melakukan senam sucita yang dipimpin oleh ibu &ndash; ibu pkk kemudian dilanjutkan dengan senam gemu famire yang dipimpin oleh anggota karang taruna. Setelah melaksanaan jalan santai para peserta sangat bersemangat menunggu hadiah doorpize dimana hadiah utamanya yaitu 1 kompor gas. Pada saat ini juga telah terlaksana pelayanan kesehatan gratis yang dilaksanakn oleh pegawai kesehatan Rumah Sakit Wisma Prasanthi. Pada malam hari minggu, 14 Agustus 2022 telah terlaksana lomba menyanyi PKK lagu pop bali dan lagu pop Indonesia yang di ikuti oleh ibu &ndash; ibu PKK Desa Gubug.</p>\r\n\r\n<p>Senin, 15&nbsp; Agustus 2022 bertempat di lapangan Desa Gubug telah terlaksana lomba olah raga Siswa SD se Desa Gubug. Lomba tersebut terdiri dari lomba balap karung, lomba ngulat tipat bergoyang, lomba balon berpasangan, lomba menangkap belut, lomba makan kerupuk. Tak hanya murid sekolah dasar saja yang memeriah acara tersebut bahkan ada warga sekitar Desa Gubug juga ikut serta untuk memeriahkannya. Pada malam hari telah terlaksana lomba pidato Siswa SD&nbsp; se Desa Gubug dan acara hiburan jogged bumbung</p>\r\n\r\n<p>Selasa, 16 Agustus 2022 pagi bertempat di lapangan Desa Gubug telah terlaksana lomba sepak bola (SSB Cup) yang diikuti oleh siswa SD Se Desa Gubug. Selain itu ada juga lomba Fun bike yang di merihakan oleh warga Desa gubug. Tidak hanya warga Desa Gubug saja yang mengkuti&nbsp; bahkan tidak sedikit warga di luar Desa Gubug mengikutinya.</p>\r\n\r\n<p>Sore hari pada tanggal 16 agustus 2022 telah terlaksana pawai obor yang dimeriahkan oleh Perangkat Desa, Mahasiswa KKN Universitas Mahasaraswati Denpasar, Siswa Sekolah Dasar, Karang Taruna serta STT dan Baleganjur Desa Gubug. Acara diawali dengan sambutan bapak Perbekel I Nengah Mawan dan dilanjutkan dengan penyalaan obor pertama. Rute pawai obor dimulai dari Lapangan Desa Gubug menuju Makam Pahlawan Desa Gubug.</p>\r\n\r\n<p>Itu lah beberapa rangkaian lomba yang diadakan selama rangkaian kegiatan HUT RI ke-77 dan HUT Desa Gubug ke-101</p>', 'pic_1663599452_img.jpeg', 'rangkaian-kegiatan-lomba-hut-ri-ke-77-dan-hut-desa-gubug-ke-101-BRT-20220831045544', '2022-08-31', '2023-04-23', '2023-04-23'),
('BRT-20230130040544', 'USER-20220218110402', 'PENYULUHAN PEREMPUAN DAN PERLINDUNGAN ANAK', '<p>Tingkat kesadaran terhadap kualitas hidup dengan kesejahteraan secara lahir dan batin sudah banyak meningkat. Tak terkecuali bagi TP PKK dan Kader Poyandu Balita desa Gubug, menginginkan warganya agar bisa hidup dengan pendidikan yang semakin baik untuk anak-anaknya. Selain pola pengasuhan yang jauh dari kekerasan juga menjaga agar kaum perempuan bisa menjaga dirinya dari tindakan kekerasan dalam rumah tangga. Berbekal wacana tersebut Ketua TP PKK&nbsp; Desa Gubug, Ni Wayan Sunita Ariati menggagas dilaksanakannya Penyuluhan Perlindungan Perempuan dan Anak. Gayung bersambut dengan&nbsp; Ketua POSYANKUMHAMDESA, Desa Gubug I Wayan Suwitra, SH untuk mewujudkan kegiatan tersebut. Hari Rabu, tanggal 15 Mei 2021 di ruang Rapat Kantor Desa dengan undangan sekitar 40 peserta dari anggota PKK dan Kader Posyandu Balita Desa Gubug. Acara dimulai pukul 09.00&nbsp; sampai pukul 12.30 WITA berlangsung dengan sersan (serius tapai santai).&nbsp; Pemateri tandem dari luar adalah Ibu Budawati selaku Ketua Yayasan Bali WCC dan sekaligus beliau merupakan seorang Pengacara. Berbagi tugas antara pemateri satu yaitu Ibu Ida Ayu Putu Sri Herawati. Merupakan PPL Hukum dari Kanwil Hukum dan Ham Wilayah Bali menyampaikan tentang Perlindungan Perempuan dan Anak dan pemate</p>\r\n\r\n<p>ri kedua menyampaikan materi tentang ketidakadilan atau bias gender sebagai bagian dari pembahasan dasar yang harus dipahami oleh peserta.&nbsp;</p>\r\n\r\n<p>Dalam sambutannya Perbekel desa Gubug I Nengah Mawan menyampaikan Ucapan terima kasih kepada Narasumber yang telah berkenan hadir di sela-sela kesibukan beliau, dan ucapan terima kasih kepada Ibu-ibu perwakilan dari masyarakat Desa Gubug semuanya Lebih lanjut disampaikan bahwa. Pembangunan Desa&nbsp; menyatukan KOMITMEN dan Sumber Daya Pemerintah Desa, Masyarakat dan Dunia Usaha yang ada di desa dalam rangka&nbsp; menghormati, menjamin, memenuhi hak-hak anak, melindungi perempuan dan anak dari tindak kekerasan, eksploitasi, pelecehan dan diskriminasi, dan mendengar pendapat anak, yang direncanakan secara sadar, menyeluruh dan berkelanjutan</p>\r\n\r\n<p>Dalam Penyuluhan ini sangat penting dan berarti sekali maknanya, anggap saja saya sebagai propokator dalam konotasi positive, karena selama ini disinyalir bahwa Ibu-ibu rumah tangga selalu mengalah walupun dalam keadaan tertekan dan setelah mengikuti penyuluhan ini diharapkan mulai dapat angkat bicara karena sudah tahu akan hak-haknya demi kebaikan keluarga. &ldquo;Kata kuncinya adalah demi Kebaikan keluarga dan masa depan anak.&rdquo; Di samping itu diharapkan perempuan agar berani bicara di forum-forun yang ada, untuk menyuarakan hak-haknya dalam rangka penegakan Emansifasi perempuan dan kesetaraan gender.</p>\r\n\r\n<p>Tujuan materi ini disampaikan agar peserta bisa meningkatkan kualitas Pendidikan, pengetahuan dan Hak-hak yang dimiliki oleh perempuan dan anak yang dijamin oleh Undang-undang, sehingga</p>\r\n\r\n<p>menjadikan pribadi yang mandiri dalam menjalankan tugas yang tidak mudah namun tetap bermartabat.</p>\r\n\r\n<p>Demikian kegiatan ini dilaksanakan dalam situasi kondisi masih siaga menghadapi Covid-1. &nbsp;Sehingga pelaksanaan terbatas waktu, tempat dan peserta penyuluhan. Namun semua hal tersebut tidak mengurangi antusiasme peserta dalam mengikuti kegiatan sampai selesai.&nbsp;Tak satupun yang beranjak dari kursi dari awal hingga akhir. Semoga apa yang sudah tersampaikan dalam kegiatan bisa membawa manfaat dan bisa diaplikasikan dalam kehidupan sehari-hari@51**</p>', 'pic_1683509267_pic_1675051544_WhatsApp_Image_2023-01-30_at_12.05.23.jpeg', 'penyuluhan-perempuan-dan-perlindungan-anak-BRT-20230130040544', '2023-01-30', '2023-05-08', NULL),
('BRT-20230130042627', 'USER-20220218110402', 'TP PKK LAKUKAN PENYULUHAN POLA ASUH ANAK , PHBS DAN  PEMBERIAN MAKANAN TAMBAHAN PADA ANAK-ANAK DAN ORANG TUA PAUD/TK', '<p>Keluarga merupakan lingkungan sosial pertama yang ditemui individu sejak mereka lahir ke dunia. Lingkungan keluarga pertama adalah Ayah, Ibu dan individu itu sendiri. Hubungan antara individu dengan kedua orangtuanya merupakan hubungan timbal balik dimana terdapat interaksi di dalamnya.</p>\r\n\r\n<p>Setiap orang tua tentunya ingin yang terbaik bagi anak-anak mereka. Keinginan ini kemudian akan membentuk pola asuh yang akan ditanamkan orang tua kepada anak-anak. Pola asuh pada prinsipnya merupakan&nbsp;<em>parental&nbsp;</em>control yaitu bagaimana orang tua mengontrol, membimbing, dan mendampingi anak-anaknya untuk melaksanakan tugas-tugas perkembangannya menuju pada proses pendewasaan.&nbsp; Berorientasi dari pemahaman tersebut TP PKK Desa Gubug menyelenggarakan Penyuluhan tentang Pola asuh anak, PHBS dan makanan tambahan bagi orang tua anak-anak PAUD/ TK Tunas Harapan.</p>\r\n\r\n<p>Kegiatan dilaksanakan pada Hari Selasa, 6 Desember 2022 bertempat di sekolah PAUD/TK Tunas Harapan. Kegiatan mulai pukul 08.00 -11.00 WITA yang dihadiri oleh Ketua TP PKK Desa Gubug beserta anggotangnya, Bidan Desa, Guru PAUD/TK Tunas Harapan, Para orang tua dan anak-anak PAUD/TK dan yang bertidak sebagai fasilitator adalah A.A Manik Apriani (Ketua Pokja IV), Gusti Ayu Putu Parwitawati (Kader Posyandu) dan Ni Putu Suarlin (Kader pendidikan).</p>\r\n\r\n<p>Pada kesempatan tersebut ketua TP PKK Desa Gubug (Ni Wayan Sunita Ariati ) mengemukankan bahwa Mengasuh dan mendidik anak adalah tugas dan tanggungjawab yang paling berat bagi para orang tua.&nbsp;Tapi, bukan tidak mungkin melakukannya. Yang terpenting adalah bahwa setiap orang tua itu sadar dan mau belajar untuk menjadi orang tua yang lebih baik lagi. Disamping itu bagaimana car anya kita selaku orang tua menanamkan nilai-nilai moral, etika dan kebiasaan pada anak-anak kita, agar anak kita dapat tumbuh menjadi pribadi mandiri, sehat, cerdas dan Tangguh, tentunya mewujudkanya anak-anak perlu diberikan makanan yang beragam, bergizi, sehat dan aman (B2SA).</p>\r\n\r\n<p>Penyuluhan berjalan dengan aman dan lancar penuh dinamika, banyak ada usul saran dari orang tua anak PAUD/TK.&nbsp; Salah satunya Ni Putu Candrawati menyampaikan ucapan terima kasih kepada TP PKK Desa dan para guru PAUD/TK yang telah menyelenggarakan penyuluhan ini, dan berharap di tahun depan agar tetap dilaksanakan penyuluhan yang serupa dan ditambahkan pelatihan tentang pembuatan makanan tambahan untuk anak anak dan termasuk pelatihan penganekaragam olahan yang bergizi dan sehat untuk keluarga dengan menggunakan bahan baku lokal yang murah dan mudah didapat.@51**</p>', 'pic_1683509287_pic_1675052787_WhatsApp_Image_2023-01-30_at_12.08.32.jpeg', 'tp-pkk-lakukan-penyuluhan-pola-asuh-anak-phbs-dan-pemberian-makanan-tambahan-pada-anak-anak-dan-orang-tua-paud-tk-BRT-20230130042627', '2023-01-30', '2023-05-08', NULL),
('BRT-20230130042813', 'USER-20220218110402', 'PELATIHAN DAN REMBUG STUNTING DI DESA GUBUG', '<p>Pada Hari Rabu Tanggal 3 Agustus 2022 Pemerintah Desa Gubug, Kecamatan Tabanan, &nbsp;mengadakan Pelatihan &nbsp;dan Rembug stunting sebagai salah satu tahap perencanaan Desa Gubug untuk Rencana Kerja Pemerintah Desa Gubug Tahun 2023 yan Pelatihan dan Rembug stunting ini dilaksanakan dengan&nbsp; Sasaran, Kader PKK Desa dan Kader Posyandu balita Desa Gubug.&nbsp; &nbsp;Tujuan Pelatihan dan rembug stunting itu sendiri adalah Pemaparan data sasaran, layanan&nbsp; dan permasalahan-permasalahan stunting serta analisis penyebabnya, Pembahasan usulan program/kegiatan intervensi gizi spesifik dan sensitif yang disusun dalam diskusi kelompok terarah (FGD) di Rumah Desa Sehat dan Pembahasan dan penyepakatan prioritas usulan program/kegiatan intervensi gizi spesifik dan sensitif. Kesepakatan hasil rembug stunting dituangkan dalam Berita Acara.</p>\r\n\r\n<p>Hadir dalam acara Pelatihan ini Kepala Dinas Kesehatan Kabupaten Tabanan yang diwakili oleh Sekretaris Dinas Kesehatan dan Bapak Kepala PUSKESMAS Tabanan I selaku Narasumber. Sedangkan selaku Fasilitator adalah Stap Puskesmas Tabanan I dan PLKB Desa Gubug dan juga Pendamping Desa. &nbsp;</p>\r\n\r\n<p>Kepala Desa Gubug menyampaikan ucapan terimakasih dan apresiasi kepada Bapak Kepala Dinas Kesehatan Kabupaten Tabanan, Bapak Kepala PUSKESMAS Tabanan I beserta jajaranya, Bapak PLKD Desa Gubug, Bapak Pendamping Desa dan terutama sekali kepada Ibu Tim Penggerak&nbsp; PKK serta Kader Posyandu Balita Desa Gubug, karena berkat kerja sama yang sangat baik dan upaya yang maksimal sehingga Desa Gubug tahun ini bebas Stunting dan berharap di tahun selanjutnya kerja sama dan kondisi ini bisa dipertahankan dan ditingkatkan.</p>\r\n\r\n<p>Bapak Kepala PUSKESMAS Tabanan I menyampaikan bahwa Astunkara di Desa Gubug sudah mengoptimalkan upaya pencegahan stunting &nbsp;melalui melalui TP PKK dan Kader Posyandu Balita Desa sehingga Desa Gubug tahun ini bebas dari stunting dan Beliau berharapan agar Desa Gubug dapat mempertahankan kondisi Desa bebas stunting dan menjadi salah satu barometer keberhasilan Desa di Kecamatan Tabanan.</p>\r\n\r\n<p>Bapak Sekretaris Dinas Kesehatan Kabupaten Tabanan menyampaiakan hal yang senada dan beliau menghimbau&nbsp; agar kita semua selalu optimis diikuti dengan upaya dengan kerja keras, kerja cerdas dan kerja ikhlas astunkara akan terwujud hasil yang tuntas, seperti hasil yang diraih tahun ini.&nbsp; Mari kita tingkatkan komusnikasi dan koordinasi dengan inten demi terwujudnya Kesehatan masyarakat kita semua.&nbsp;</p>\r\n\r\n<p>Adapun hasil Pelatihan dan rembug stunting yang disepakati untuk diusulkan dalam musrenbangdesa dengan harapan dapat dianggarkan dalam APBDesa tahun 2023 adalah :</p>\r\n\r\n<ol>\r\n	<li>Pelatihan Kader BKB dan PHBS</li>\r\n	<li>Penambahan peralatan Posyandu dengan pengadaaan alat ukur Bayi</li>\r\n	<li>Pengadaan APE luar dan APE dalam sesuai usia 0- 2th</li>\r\n	<li>Rembug stunting</li>\r\n	<li>Pelatihan Membuat makanan tambahan bagi bayi</li>\r\n	<li>Pelatihan / orientasi untuk kesehatan reproduksi&nbsp; untuk remaja terutama calon pengantin</li>\r\n	<li>Pelatihan pencegahan anemia dan penyakit menular</li>\r\n	<li>Peningkatan Operasional PAUD/TK</li>\r\n	<li>Peningkatan insetif Kader Posyandu dan operasional KPM</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ibu Putu Suarlin &nbsp;selaku Kader pendidikan menyampaikan masih banyak problem terkait dengan penanganan anak dan ibu hamil serta orang tua PAUD/TK di Desa Gubug seperti kurang paham nya ibu hamil dan orang tua anak PAUD/TK dalam hal jaminan kesehatan bagi ibu hamil dan Balita, juga dalam penyajian Makanan Tambahan yang masih monoton, sehingga perlu ada pelatihan yang serupa di tahun depan. Selanjutnya Ibu A.A Manik Apriani selaku salah satu Kader Posyandu Balita Desa Gubug menambahkan bahwa Sasaran prioritas konvergensi pencegahan stunting adalah ibu hamil dan anak usia 0-23 bulan atau rumah tangga 1000 HPK sebagai masa yang paling kritis dalam tumbuh kembang anak dan anak usia 24-59 bulan serta wanita subur dan remaja putri @51**</p>', 'pic_1683509334_pic_1675052893_WhatsApp_Image_2023-01-30_at_12.27.40.jpeg', 'pelatihan-dan-rembug-stunting-di-desa-gubug-BRT-20230130042813', '2023-01-30', '2023-05-08', NULL),
('BRT-20230130043016', 'USER-20220218110402', 'TP PKK GELAR PELATIHAN BERBAGAI OLAHAN DALAM MASA PANDEMI COVID-19', '<p>Masa pandemi covid-19 yang belum berakhir menuntut semua orang untuk menjaga imunitas tubuh. Imun tubuh salah satunya dapat diperoleh dari pangan lokal di sekitar kita. Maka pentingnya, mengolah pangan dari bahan pangan lokal, yang mudah didapat dan murah.&nbsp;</p>\r\n\r\n<p>Hal tersebut mungkin mengilhami pemikiran TP PKK Desa Gubug, sehingga dalam menggerakan meningkatkan kreatifitas anggotanya, akhirnya menggelar pelatihan pengolahan berbagai jenis olahan berbahan lokal yang murah dan mudah didapat.secara swadaya.</p>\r\n\r\n<p>Dalam pelatihan ini tidak mendatangkan pelatih/fasilitator dari luar, hanya menggunakan instruktur dari kalangan PKK yaitu Ni Made Ariani dari Dusun Curah, yang cukup mempunyai keterampilan dalam bidang pembuatan berbagai macam olahan, pelatihan bertempat di P4S Sari Genep</p>\r\n\r\n<p>Banyak Tujuan yang ingin dicapai dalam pelaksanaanya. Dalam situasi Covid-19 yang mulai melandai tentunya ada banyak waktu bagi ibu-ibu, adanya kejenuhan sudah lama berdiam diri, ADA keinginan untuk berkumpul dengan teman-teman juga adanya keinginan yang kuat untuk meningkatkan pengetahuan, wawasan, dan keterampilan ibu-ibu TP PKK tentang pengolahan pangan beragam, bergizi, seimbang, dan aman.&nbsp; Disamping itu, juga untuk memasyarakatkan dan membudayakan pola konsumsi pangan B2SA kepada masyarakat. Juga ajakan untuk memanfaatkan pangan lokal sebagai sumber gizi keluarga demi terciptanya pola hidup sehat, aktif, dan produktif.</p>\r\n\r\n<p>Ketersediaan bahan pangan lokal di Desa Gubug cukup melimpah adanya. Pengetahuan masyarakat masih kurang terutama dalam pengolahan dan pemenuhan konsumsi gizi bagi keluarga yang beragam, bergizi, seimbang dan aman (B2SA).&nbsp;Bahkan pengolahannya masih apa adanya dan kurang memenuhi syarat kesehatan seperti keamanan makanan, ukuran atau takaran makanan,.</p>\r\n\r\n<p>Melalui pelatihan ini diharapkan, akan dapat mengimplementasikan pengolahan pangan yang memenuhi syarat B2SA dan dengan penyajian yang menarik.</p>\r\n\r\n<p>Tentunya dengan bahan lokal yang ada di sekitar kita seperti pemanfataan Hatinya PKK. Kita harus bangga dengan pangan lokal, jangan bangga dengan makanan instan.</p>\r\n\r\n<p>Pelatihan ini diikuti sebanyak 20 orang &nbsp;peserta dari kalangan Ibu-ibu TP PKK Desa dan kelompok PKK dusun, yang dibagi menjadi &nbsp;dua kelompok selama dua hari.&nbsp; Dalam pelatihan ini dilaksanakan dengan tetap menggunakan protokol&nbsp;Kesehatan.@51**</p>', 'pic_1683509316_pic_1675053016_WhatsApp_Image_2023-01-30_at_12.29.03.jpeg', 'tp-pkk-gelar-pelatihan-berbagai-olahan-dalam-masa-pandemi-covid-19-BRT-20230130043016', '2023-01-30', '2023-05-08', NULL);
INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20230130043123', 'USER-20220218110402', 'MELALUI HUT DESA GUBUG KE 101, GELAR PAMERAN UKM/IKM', '<p>Pemerintah Desa Gubug Kecamatan Tabanan, Kabupaten Tabanan menggelar pameran UKM dan IKKM yang digelar di Lapangan desa Gubug. Acara yang berlangsung mulai 13 agustus sampai 16 agustus 2022 ini merupakan bagian dari rangkaian acara peringatan HUT RI ke-77 dan HUT Desa Gubug ke 101.<br />\r\nPerbekel desa Gubug mengatakan bahwa dalam acara tersebut pihaknya menyediakan puluhan&nbsp; stand untuk diisi oleh UKM, IKM masing-masing Dusun se Desa Gubug, dan BUMDesa se Kecamatan Tabanan serta BUMDesa Bersama Kecamatan Tabanan. Acara ini juga bertujuan untuk mendukung pelaku UKM dan IKM di desa Gubug. Ia mencatat setidaknya ada 400 lebih UKM dan IKM yang ada di Desa Gubug. Untuk itu, ia mengajak seluruh masyarakat desa Gubug untuk bersinergi memberdayakan anak muda (kaum Milenial) untuk &nbsp;bergerak di sektor UKM dan IKM.</p>\r\n\r\n<p>Pameran UKM ini, dibuka pada hari Sabtu 13 Agustus 2022 di Lapangan Desa Gubug tepatnya di depan&nbsp; kantor Desa Gubug. &nbsp;Acara Pembukaan ini dihadiri oleh bupati Tabanan, sebelum acara dimulai Bupati mengunjungi satu per satu stan- pameran yang ada dan beliau berdialog langsung dengan masyarakat atau pelaku usaha secara kekeluargaan dan disambut hangat oleh para pelaku usaha. Selanjutnya &nbsp;dalam sambutanya Bupati Tabanan &nbsp;mengatakan bahwa pameran ini sangat penting agar kita dapat lebih melihat secara langsung kelayakan atau kualitas sebuah produk&nbsp; dihasilkan oleh masyaraka apalagi dalam situasi vandemi seperti sekarang. Kita harus bangga jadi orang Tabanan, bangga jadi orang Gubug, dan cintai produk sendiri produk yang dihasilkan oleh UKM dan IKM kita. Mari kita bangkitkan&nbsp; mari kita disport agar UKM dan IKM bisa tumbuh dan berkembang seperti di waktu normal. &nbsp;&nbsp;Sekalian beliau mengucapkan digahayu Republik Indonesia&nbsp; ke 77 dan Dirgahayu Desa Gubug ke 101</p>\r\n\r\n<p><br />\r\nDi tempat terpisah Ketua BPD Desa Gubug menyampaikan bahwa sebenarnya produk-produk unggulan yang dikemas oleh masyarakat atau para pelaku usaha di Desa Gubug &nbsp;sudah berani bersaing dipasaran. &nbsp;Apalagi Desa Gubug cukup kaya akan bahan baku kuliner, kerajinan dan sebagainya. Melalui pameran ini masyarakat diharapkan dapat mengikutinya, sehingga bisa mengetahui potensi-potensi produksi yang ada, kemudian nantinya dikembangkan untuk meningkatkan pendapatan ekonomi masyarakat kita, dan ekonomi secara keseluruhan di Desa.@51**&nbsp;<br />\r\n&nbsp;</p>', 'pic_1683509352_pic_1675053083_WhatsApp_Image_2023-01-30_at_12.30.57.jpeg', 'melalui-hut-desa-gubug-ke-101-gelar-pameran-ukm-ikm-BRT-20230130043123', '2023-01-30', '2023-05-08', NULL),
('BRT-20230130043303', 'USER-20220218110402', 'KETAHANAN PANGAN NABATI/HEWANI DI DESA GUBUG TAHUN 2022', '<p>Ketahanan pangan dan hewani menjadi salah satu amanat penting dalam Peraturan Presiden No 104 Tahun 2021 untuk dijadikan sasaran prioritas. Peraturan ini secara tegas memberikan porsi anggaran sebesar 20% dari total dana desa.</p>\r\n\r\n<p>Itu artinya jika dihitung secara matematis, porsi peningkatan ketahanan pangan dan hewani di desa sesuai dengan amanat Perpres sebesar seperlima dari jumlah dana desa yang dikucurkan.</p>\r\n\r\n<p>Tahun 2022 ini,berdasarkan regulasi yang ada. di Desa Gubug, program Penguatan Ketahanan Pangan direalisasikan melalui budidaya tanaman padi, Jagung dan Cabai, mengingat Desa Gubug mempunyai lahan sawah produktif yang cukup luas, yaitu separo lebih dari luas Desa.</p>\r\n\r\n<p>Program penguatan ketahanan pangan di Desa Gubug ini diawali dengan membuat Pedoman Program penguatan ketahanan pangan dan hewani Berdasarkan Pedoman tersebut memulai tahapan pelaksanaanya, seperti penentuan lahan yang akan dijadikan objek pertanian dengan sistem yang disepakati, selanjutnya tim pelaksana kegiatan mengadakan sosialisasi terkait perekrutan Padat Karya Tunai Desa (PKTD) yang berasal dari KK Miskin yang akan dijadikan pekerja dalam kegiatan budidaya tersebut.</p>\r\n\r\n<p>Setelah dipandang sudah cukup siap barulah memulai kegiatan yaitu budidaya Cabai seluas 0,5 ha, Jagung 3 ha dan padi 4 ha dengan menggunakan Dana desa sebesar 180 juta rupiah (20% dari DD). Yang pertama adalah menanam Jagung pada Hari Selasa Tanggal 5 April dan panen pada 14 Juli 2022. Ke dua menanam Cabai pada hari &nbsp;Kamis tanggal 5 Mei 2022 kemudian panen sampai Bulan Desember 2022.&nbsp;&nbsp; Ketiga menanam padi mulai pada hari Kamis Tanggal 28 Juli 2022 dan mulai panen pada hari 1 Nopember tanggal 2022</p>\r\n\r\n<p>Selain proses budidaya, kegiatan ini juga rencananya akan dijadikan wahana edukasi bagi masyarakat terkait penanaman cabai dan jagung sehingga dapat memotivasi petani lainya untuk meningkatkan pemndapatan.&nbsp; Khusus untulk budidaya padi tidak dilakukan dengan pola PKTD tetapi pola bantuan Hibah kepada kelompok tani, dan kegiatan seperti ini sudah dilakukan setiap tahun di Subak yang ada secara bergiliran dalam rangka meningkatkan Kuantitas, kualitas dan produktifitas produksi padi/gabah.</p>\r\n\r\n<p>Setelah melakukan Program ketahanan pangan dan hewani ini menjadikan Desa tahu persis akan maksud program ini adalah tidak terlepas dari adanya pandemi covid yang membuat pasokan rantai ketahanan pangan mengalami gangguan sehingga diharapkan desa bisa segera berbenah untuk memperbaiki kembali. Disamping itu juga agar Pemerintah Desa dapat melakukan penyesuaian kegiatan pangan dan hewani sesuai dengan karakteristik dan potensi desa yang ada. Pada ketentuan kedua ini, sejatinya pemerintah memberikan kesempatan bagi desa untuk melakukan perbaikan tata kelola bentang potensi alam dan sumber dayanya di dalam sektor pangan dan protein hewani.@51**</p>', 'pic_1683509236_pic_1675053183_WhatsApp_Image_2023-01-30_at_12.32.12.jpeg', 'ketahanan-pangan-nabati-hewani-di-desa-gubug-tahun-2022-BRT-20230130043303', '2023-01-30', '2023-05-08', NULL),
('BRT-20230423125159', 'USER-20220218110402', 'TAHUN 2023 DESA GUBUG MENGGELAR KEMBALI PROGRAM KETAHANAN PANGAN/HEWANI SEPERTI TAHUN SEBELUMNYA', '<p>Sebagaimana diamanatkan dalam Peraturan Menteri Keuangan Republik Indonesia Nomor 201/PMK.07/2022 tentang Pengelolaan Dana Desa 2023, bahwa Pemerintah Desa menganggarkan kegiatan ketahanan pangan dan hewani sesuai dengan potensi Desa. Adapun potensi Desa Gubug; memiliki kebiasaan hidup masih sangat tergantung pada alam. Karakteristiknya:<em>,</em> gotong royong, homogen, dan toleransi kuat. Sedangkan potensi Desa Gubug memiliki sumber daya alam pertanian yang sebagian masyarakatnya membudidayakan tanaman padi disamping juga mengembangkan tanaman sayuran dataran rendah, ternak, dan ikan.</p>\r\n\r\n<p>Prioritas penggunaan Dana Desa tahun anggaran 2023 sebagaimana diatur dalam Peraturan Menteri Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi Nomor 8 Tahun 2022 tentang Prioritas Penggunaan Dana Desa, bahwa prioritas penggunaan Dana Desa bertujuan untuk pemulihan ekonomi nasional, program prioritas nasional, dan mitigasi dan penanganan bencana alam dan non-alam untuk mendukung pencapaian SDGs Desa.&nbsp;</p>\r\n\r\n<p>Untuk program ketahanan pangan dan hewani itu sendiri sebagaimana diatur dalam Peraturan Menteri Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi Nomor 8 Tahun 2022 tentang Prioritas Penggunaan Dana Desa adalah termasuk dalam kategori prioritas yang diarahkan bagian program prioritas nasional sesuai kewenangan Desa dalam rangka untuk mewujudkan Desa tanpa kelaparan (SDG&rsquo;s ke-2), yang kegiatannya meliputi:</p>\r\n\r\n<ol>\r\n	<li>pengembangan usaha pertanian, perkebunan, perhutanan, peternakan dan/atau perikanan,</li>\r\n	<li>pembangunan lumbung pangan Desa,</li>\r\n	<li>pengolahan pasca panen, dan</li>\r\n	<li>penguatan ketahanan pangan lainnya yang sesuai dengan kewenangan Desa dan diputuskan dalam Musyawarah Desa</li>\r\n</ol>\r\n\r\n<p>Teknis pelaksanaan kegiatannya sendiri diutamakan melalui swakelola dengan memanfaatkan segala sumber daya yang ada di Desa melalui skema Padat Karya Tunai Desa (PKTD). Sebagaimana diterapkan tahun sebelumnya, Pada tahun 2023 Desa Gubug Kembali melakukan kegiatan yang sama di bidang pertanian yaitu dengan memanam padi dan cabai.</p>\r\n\r\n<p>Penanaman padi yang dilakukan merupakan kegiatan yang berkelanjutan dalam upaya peningkatan kuantitas, kualitas dan produktifitas produksi padi di desa Gubug dengan melaksanakan Deam Farm yaitu seluas 3 ha. Selain itu juga dilakukan pengkajian inovasi peningkatan kuantitas, kualitas dan produktifitas produksi padi dengan Teknik budidaya padi NEW-AN.&nbsp; Teknik NEW-AN merupakan Teknik baru yaitu dengan cara memodifikasi cara budidaya padi yang telah ada dengan tujuan untuk meningkatkan jumlah dan mutu gabah serta meningkatkan indek panen.</p>\r\n\r\n<p>Penanaman cabai kali ini lagi dilakukan mengingat capaian yang didapat pada tahun lalu, dipandang cukup berhasil dalam penyediaan lapangan pekerjaan bagi masyarakat miskin dan masyarakat yang kehilangan pekerjaan akibat covid-19 dan &nbsp;membantu pemerintah dalam menekan laju inpalsi akibat melambungnya harga cabai. Disamping itu juga dapat dijadikan tempat berlatih dan study tiru bagi petani Desa Gubug dan petani dari Desa sekitarnya.&nbsp;&nbsp; Penanaman cabai kali ini dilakukan di Subak Gubug II, Tempek Ureg&nbsp; yaitu seluas 35 are.&nbsp; Lahan yang digunakan merupakan lahan milik warga dengan pola Kerjasama bagi hasil. @51**</p>', 'pic_1682255084_berita1.png', 'tahun-2023-desa-gubug-menggelar-kembali-program-ketahanan-pangan-hewani-seperti-tahun-sebelumnya-BRT-20230423125159', '2023-04-23', '2023-04-23', NULL),
('BRT-20230423130908', 'USER-20220218110402', 'MUSDESUS BLT DD GUBUG, TENTANG PENETAPAN CALON PENERIMA BLT DD  TAHUN 2023', '<p>Badan Permusyawaratan Desa (BPD) Desa Gubug &nbsp;I Wayan Suwitra, SH pimpin Musyawarah Desa Khusus (Musdessus) dalam rangka falidasi, finalisasi dan penetapan calon Keluarga Penerima Manfaat (KPM) Bantuan Langsung Tunai bersumber Dana Desa (BLT-DD) yang diusulkan oleh Perbekel. Dimana Sebelumnya Kepala Kewilayahan telah melakukan identifikasi, falidasi dan pendataan calon KPM BLT-DD tahun 2023 yang selanjutnya dilakukan Musyawarah Dusun oleh BPD.</p>\r\n\r\n<p>Musdesus dilaksanakan pada tanggal 17 Januari 2023 dihadiri Anggota BPD, Perangkat Desa, Pendamping Desa Kecamatan Tabanan,&nbsp; perwakilan Lembaga masyarakat (LKD dan LAD), Tokoh masyarakat, perwakilan kelompok yang ada dimasyarakat.</p>\r\n\r\n<p>Bantuan Langsung Tunai bersumber Dana Desa (BLT-DD) tahun 2023, merupakan lanjutan program pemberian BLT Desa tahun sebelumnya. Pada tahun 2022 pemerintah lebih menekankan penggunaan Dana Desa untuk BLT Desa dengan menetapkan prosentase minimal. Merunut Peraturan Presiden nomor 104 tahun 2021 tentang Rincian APBN tahun anggaran 2022, DANA DESA ditentukan penggunaannya untuk program perlindungan sosial berupa:</p>\r\n\r\n<ol>\r\n	<li>BLT Desa paling sedikit 40%,</li>\r\n	<li>program ketahanan pangan dan hewani paling sedikit 20%,</li>\r\n	<li>dukungan pendanaan penanganan Covid-19 paling sedikit 8%, dan</li>\r\n	<li>program sektor prioritas Nasional sesuai kewenangan desa lainnya.</li>\r\n</ol>\r\n\r\n<p>Persentase penggunaan tersebut dihitung dari Dana Desa pada setiap desa. Hal ini berbeda dengan penggunaan Dana Desa tahun 2023. Pemerintah menetapkan pola minimal dan maksimal dalam penganggaran BLT-DD. Sehingga desa dapat menentukan kebijakan sesuai dengan kondisional desa. Angka kemiskinan masing-masing desa memang berbeda.</p>\r\n\r\n<ul>\r\n	<li>BLT Desa paling sedikit 10% dan maksimal 25%,</li>\r\n	<li>Operasional Pemerntah Desa 3%,</li>\r\n	<li>program ketahanan pangan dan hewani 20%,</li>\r\n	<li>dukungan pendanaan untuk penanganan Covid-19,</li>\r\n	<li>mitigasi bencana alam dan non alam.</li>\r\n</ul>\r\n\r\n<p>BLT Desa sebagaimana dimaksud dalam Peraturan Menteri Keuangan Nomor 128/PMK.07 /2022 tentang Perubahan Atas Peraturan Menteri Keuangan Nomor 190/PMK.07 /2021 Tentang Pengelolaan Dana Desa Pasal 32 ayat (1) huruf a dapat diberikan kepada keluarga penerima manfaat yang memenuhi kriteria sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>keluarga miskin atau tidak mampu yang berdomisili di Desa bersangkutan dan diprioritaskan untuk keluarga miskin yang termasuk dalam kategori kemiskinan ekstrem;</li>\r\n	<li>kehilangan mata pencaharian;</li>\r\n	<li>mempunyai anggota keluarga yang rentan sakit menahun/kronis;</li>\r\n	<li>keluarga miskin penerima jaring pengaman sosial dari APBN yang terhenti;</li>\r\n	<li>keluarga miskin yang terdampak pandemi Corona Virus Disease 2019 (COVID-19) dan belum menerima bantuan; atau</li>\r\n	<li>rumah tangga dengan anggota rumah tangga tunggal lanjut usia dan atau sakit sakitan</li>\r\n</ol>\r\n\r\n<p>Dari hasil identifikasi dan pendataan yang dilakukan oleh Kepala kewilayahan yang dilaporkan kepada perbekel, maka dalam musdes khusus ini perbekel mengajukan calon penerima BLT DD tahun 2023 sebanyak 25 orang jauh menurun dari tahun sebelumnya yaitu sebanyak 101 orang.&nbsp; Selanjutnya&nbsp; calon tdersebut diverifikasi dan dimusyawarahkan kemudian difinalisasi dan disepakati sebagai penerima BLTDD Desa Gubug Tahun 2023 yang sekaligus merupakan hasil akhir keputusan musyawarah desa khusus tahun 2023 @51**</p>', 'pic_1682255348_berita2.jpg', 'musdesus-blt-dd-gubug-tentang-penetapan-calon-penerima-blt-dd-tahun-2023-BRT-20230423130908', '2023-04-23', '2023-04-23', NULL),
('BRT-20230423131810', 'USER-20220218110402', 'POSYANKUMHAMDES DESA GUBUG GAGAS DAN LAKSANAKAN PENYULUHAN/SOSIALISASI HUKUM TENTANG HAK ASASI PEREMPUAN DAN   AD VOKASI', '<p>Mencapai kesetaraan gender dan memberdayakan semua perempuan dan anak merupakan salah satu tujuan pembangunan berkelanjutan (SDGs) yang dalam pengimplementasiannya telah menjadi komitmen Komnas HAM, demikian pula hal dengan Pemderintah Desa Gubug.&nbsp; &nbsp;Komitmen tersebut kembali dituangkan melalui Pelatihan/penyuluhan/sosialisasi terhadap kaum perempuan di Desa Gubug, Kecamatan Tabanan, Kabupaten Tabanan, Tema yang diambil adalah &nbsp;Hak asasi perempuan &nbsp;dan Advokasi Kasus Kekerasan Terhadap Perempuan dan Anak.&rsquo; Pelatihan/Penyuluhan/Sosialisasi &nbsp;diselenggarakan di&nbsp; Ruang Rapat Kantor Desa Gubug, pada Hari Minggu, tanggal 9 April 2023, dari jam 08.00 &ndash; 16.00 Wita.&nbsp; Kegiatan ini digagas dan dilaksanakan oleh Pengurus Posyankumhamdes Desa Gubug yang difasilitasi oleh Pemerintah Desa Gubug</p>\r\n\r\n<p>I WAYAN SUWITRA, SH selaku Ketua POSYANKUMHAMDES Desa Gubug &nbsp;merupakan penggagas kegiatan ini juga merupakan salah satu narasumber mengungkapkan bahwa saat ini kasus kekerasan terhadap perempuan dan anak Semakin hari kasus kekerasan terhadap perempuan dan anak terus meningkat dan penanganan nya sangat sedikit.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Lebih lanjut I Wayan Suwitra &nbsp;menjelaskan mengenai upaya yang telah dilakukan oleh POSYANKUMHAMDES Desa Gubug jika ada korban kekerasan. Tujuan kami adalah pemberdayaan, dimana korban dilibatkan dalam penyelesaian kasusnya agar kedepannya korban bisa lebih berdaya. Proses yang kami lakukan adalah melalui mitigasi dan non mitigasi. Kalau yang non mitigasi, lebih mengarah ke fasilitasi, mediasi &nbsp;dan Pendampingan, Hal ini &nbsp;menjadi lebih penting karena menyangkut bagaimana kemudian penanganan korban secara psikososialnya agar menjadi lebih baik. Semua pelayanan tersebut kami berikan secara gratis&rdquo;, seperti tugas dan fungsi Posyankumhamdes.</p>\r\n\r\n<p>&nbsp;<img alt=\"\" src=\"https://drive.google.com/file/d/1tJbLLl15eMrG2ZTtyKqxB6W2OlyHOLej/view?usp=share_link\" /><img alt=\"\" src=\"https://lh3.googleusercontent.com/II5fpE_-r5LbXcjgyka7rqh1LmOafAHGAMLwc_9PqQJ5fwzByJ8OLno-i0B2-V4_yI3auZtbGb2qk7q4yieVifAn77n4HHTr4IdUWxWF9SKMhwON2g-Oy6MLKrhkaDnSTV9JrUHXtuayLAiv3dr-vLy8nr5nRf5_tkf_WSPRtcRwVTuNUvMtok-85k8XwiMiI4_uPmtAmErPyilL7Ji57sp2rtKuN1lyBW6SPZzQFpT7PrUPVec56fUzBxgGEIiNiu0H9OZnmLWAcWuVdEdoUOSuaAdgPircuvJeMxyNTPTknHA9hp3hPKdQSjPiQQImhDnnmtefc_PYCEoyYLr4XDkVCQy5eigILjKY3-D7CqLj2VFPNIkAlml965ZSnPiWj-4TUhdPX4pmEsXFBlsEz3KUuzYh-ZDmrZ9YdN6rmU7jee7XJy8SE7sp9vBkVJnPWrAr-EH3b34PEXeeEhVSaiI0Ip0KtlN3t_Rida5fnMEypwEQFm19LfwyjDhD6GmYiB9bLndevT7U-WvdsS0OTest60PBzHFejPxn8uoRTaQRgBzQuN4BMKeUlrV5WYMj19vC-bYZVoMrlk0myyWYla9KNXMK8gf6YiA9RbVhlZP6bu7LWLJk6hW5L8g628zvxUoLmBvgpjMl-FBJoW6sqBzpAjAdGGzVDLuaAkIwkjZ9DAlJNxLnv2iM8zQslXgQQcFCMIvmNmB3d92Z3OF31xt-abm_7JQqZMMoXTAkkrdk33qvz7zQcDKv10iUZ3XW_apwR73W3luP_6W134ylx3sKDl4o_Q4FLTl9PNI1lUvsZvFcFm2PPhUniAA8fzbzxAiNdy4uJ3hnom7_9zSb_DkhZKuqjLFKacsVCUr9p2g3vklWy-ki91i3X9HaRsk-MZs6xJ8DDrEC6-haKqL9s460nT-Xlp65GBCvrBLW1ReKShXpAsoMaVXIWObrSmcKFElivB7Mz8Nl3yQuj9FccPpSXVDt9FTJcCXfWtcusjV1RDRD0qVT=w1216-h912-s-no?authuser=0\" style=\"float:left; height:225px; margin-left:5px; margin-right:5px; width:300px\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>I Nengah Mawan selaku Perbekel Desa Gubug mengucapkan terima kasih kepada Pengurus dan anggota Posyankumhamdesa Desa Gubug, karena telah banyak membantu dalam memberi informasi hukum, konsultasi hukum, mediasi Ketika masyarakat ada yang bermasalah dengan hukum, &nbsp;di samping itu pula telah berhasil mengantarkan desa Gubug sebagai Desa Sadar Hukum.&nbsp; Hal ini sangat penting untuk terus dilanjutkan terutama pemberian informasi hukum kepada masyarakat terlebih-lebih bagi kaum perempuan dalam peningkatan kesetaraan Gender. Dalam melakukan kegiatan seperti ini hendaknya juga menggunakan media yang kita miliki, seperti Face book, you tube, webb desa, WA dan lainnya sehingga informasi dapat diakses oleh masyarakat lainnya. @51**&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', 'pic_1682255890_gambar3.jpg', 'posyankumhamdes-desa-gubug-gagas-dan-laksanakan-penyuluhan-sosialisasi-hukum-tentang-hak-asasi-perempuan-dan-ad-vokasi-BRT-20230423131810', '2023-04-23', '2023-04-27', NULL);
INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20230423132218', 'USER-20220218110402', 'DESA GUBUG LAKUKAN PENYULUHAN/SOSIALISASI PROGRAM SEMARA RATIH YANG DILUNCURKAN BUPATI TABANAN', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sebagai wujud tindaklanjut program Semara Ratih dari Bupati Tabanan, maka Pemerintah Desa Gubug melaksanakan Penyuluhan/Sosialisasi Program Semara Ratih kepada masyarakat. Kegiatan ini dilakukan pada hari Jumat tanggal 30 Maret 2023, yang dihadiri oleh 63 orang terdiri dari Perbekel Desa Gubug, BPD Desa Gubug, Babinkantibmas, Babinsa, Pengurus TP PKK,&nbsp; Karang Taruna, pengurus LAD dan&nbsp; sejumlah undangan lainnya. Dan yang bertindak selaku pembawa materi penyuluhan/sosialisasi adalah Ketua POSYANKUMHAMDES Desa Gubug yang merangkap sebagai Ketua BPD Desa Gubug (I WAYAN SUWITYRA, SH).</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"height:317px; width:240px\" /></p>\r\n\r\n<p>Banyak tujuan yang ingin dicapai dalam pelaksanaannya selain agar program ini diketahui, difahami dan dilaksanakan oleh masyarakat juga bertujuan untuk untuk mempermudah administrasi kependudukan. Program Semara Ratih meliputi beberapa tahapan yang harus dilalui oleh calon pengantin sebelum melakukan perkawinan, seperti kedua mempelai diwajibkan memeriksakan diri terkait reproduksi dan kesehatan. Setelah tahap pemeriksaan kesehatan, tahapan berikutnya dilanjutkan dengan konseling mengenai kehidupan berumah tangga. Dalam tahap ini,kedua mempelai akan diberikan pemahaman dan edukasi mengenai kehidupan setelah berumah tangga dari sisi kehidupan sosial dan adat serta budaya. Selain itu dalam forum adat ini, diberikan pemahaman dan edukasi, bagaimana caranya menjadi suami istri yang baik. Setelah selesai pada tahapan tersebut, calon pengantin akan dibawa ke Babinkamtibmas&nbsp; untuk diberikan pengarahan sehingga kedepannya tidak terjadi kekerasan dalam rumah tangga selama menjadi suami istri. Selanjutnya mereka akan diedukasi oleh tim lingkungan hidup, yang mengarahkan kedua mempelai setelah melakukan upacara, untuk melakukan penanaman pohon di sekitar pekarangan rumah, dengan harapan kedua mempelai akan tumbuh bersama dengan yang mereka tanam. Tahapan terakhir dibantu oleh kepala kewilayahan untuk melengkapi administrasi perkawinan, paling lambat 10 hari sebelum hari pernikahan sudah selesai dan didaftarkan ke Dinas Catatan Sipil untuk diterbitkan akte perkawinan, Kartu Keluarga dan KTP yang baru.@51**</p>\r\n\r\n<p>&nbsp;</p>', 'pic_1682259128_berita4.png', 'desa-gubug-lakukan-penyuluhan-sosialisasi-program-semara-ratih-yang-diluncurkan-bupati-tabanan-BRT-20230423132218', '2023-04-23', '2023-04-23', NULL);
INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20230508160600', 'USER-20220218110402', 'KEPALA BADAN PEMBINAAN HUKUM NASIONAL (BPHN) KUNJUNGI POSYANKUMHAMDESA DESA GUBUG, KECAMATAN TABANAN, KABUPATEN TABANAN, PROVINSI BALI', '<p>Kepala Badan Pembinaan Hukum Nasional Kementerian Hukum dan HAM RI, Widodo Ekatjahjana mengunjungi Posyankumhamdes Desa Gubug, Kecamatan Tabanan, Kabupaten Tabanan, Sabtu (06/05/2023).</p>\r\n\r\n<p>Kegiatan ini bertujuan untuk mengetahui upaya mediasi yang telah dilakukan oleh Kepala Desa dan Paralegal Desa Gubug kepada masyarakat yang menghadapi permasalahan hukum di Desa Gubug serta memberikan penguatan kepada paralegal dan masyarakat Desa Gubug tentang pentingnya peranan Kepala Desa dan paralegal dalam menyelesaikan permasalahan yang sedang dihadapi oleh warganya.</p>\r\n\r\n<p>Kepala BPHN (Widodo Ekatjahjana) sangat mengapresiasi terbentuknya posyankumhamdes desa Gubug sehingga beberapa permasalahan hukum yang ada di Desa bisa diselesaikan secara mediasi, pentingnya peranan kepala Desa, Paralegal dalam membantu masyarakat.</p>\r\n\r\n<p>Kepala BPHN (Widodo Ekatjahjana) juga mempunyai Program PJA yang diikuti oleh Kepala Desa seluruh Indonesia dalam melatih kepala Desa menjadi Hakim Perdamaian di Desa.</p>\r\n\r\n<p>&quot;Kami harapkan juga selain Kepala Desa yang Ikut Program PJA, agar para Babinkantibmas dan Babinsa yang ada didesa diikutkan dalam program PJA&quot;, ungkap Widodo.</p>\r\n\r\n<p>Kepala Badan Pembinaan Hukum Nasional Widodo Ekatjahjana mengatakan bahwa, dalam menjaga stabilitas nasional harus dimulai dari scope/lingkup terkecil. Mulai dari keluarga, kemudian naik secara berjenjang ke level RT, RW, desa/kelurahan dan seterusnya. Oleh karena itu, peran perangkat desa menjadi amat sentral. Mereka bertindak sebagai mediator, pengayom sekaligus pemberi solusi yang dapat memberikan dampak langsung pada masyarakat.</p>\r\n\r\n<p>&ldquo;Coba bayangkan apabila tidak ada peran perbekel/kepala desa, tidak ada peran lurah, tidak ada peran babinsa atau babinkatibmas. Apakah bisa? Peran-peran untuk menjaga perdamaian tersebut telah dilakukan mereka dalam tugas dan fungsinya. Walau sepertinya tidak kelihatan, namun di lapangan telah mereka lakukan,&rdquo; ujar Widodo ketika memberikan penguatan kepada Paralegal di Desa Gubug, Kabupaten Tabanan, Bali pada Sabtu (06/05/2023).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Widodo menambahkan, hal tersebut yang kadang luput dari perhatian kita. Peran kepala desa/lurah dalam membantu menjaga stabilitas nasional seharusnya dapat diapresiasi dengan lebih baik lagi. &ldquo;Oleh karena itu, Kemenkumham melalui BPHN yang bekerja sama dengan Mahkamah Agung ingin memberikan apresiasi sekaligus memperlihatkan potret positif peran kepala desa/lurah tersebut dalam Paralegal Justice Award. Tanpa peran mereka, mungkin setiap permasalahan yang terjadi di masyarakat, kasusnya sudah naik ke kepolisian atau ke pengadilan,&rdquo; tambah Widodo.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tak hanya dari sisi Pemerintah Daerah, Kemenkumham sendiri juga terus melakukan perbaikan dalam menjaga stabilitas nasional. Salah satunya yaitu dengan melakukan transformasi pada tugas dan fungsi jabatan fungsional Penyuluh Hukum.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Kita memang sedang mentransformasi, baik secara organisasi maupun&nbsp; kelembagaan,&nbsp; tugas fungsi Penyuluh Hukum. Misalnya dengan memperkuat fungsi-fungsi penyuluhan hukum di media sosial dan perkuat sinergi dengan stakeholder lain seperti Pemerintah Provinsi, Pemerintah Daerah, Pemerintah Desa, TNI, Polri, paralegal dan Organisasi Bantuan Hukum (OBH),&rdquo; pungkas Kepala BPHN tersebut.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Salah satu bentuk sinergitas yang telah dijalankan oleh Kemenkumham dengan pemerintah desa yaitu dengan membangun Pos Pelayanan Hukum dan HAM Desa (Posyankumhamdes). Plt. Sekretaris sekaligus Kepala Pusat Perencanaan Hukum Nasional Constantinus Kristomo mengatakan, masyarakat di desa yang sedang menghadapi masalah hukum dapat datang ke Posyankumhamdes untuk konsultasi hukum, minta informasi hukum, hingga bantuan hukum jika diperlukan untuk menyelesaikan persoalan dan memperoleh keadilan.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Pos Pelayanan Hukum dan HAM Desa (Posyankumhamdes) mulai dibangun pada tahun 2020. Setahun kemudian, Posyankumhamdes mendapatkan rekomendasi untuk dinasionalisasikan. Posyankumhamdes di Tabanan ini cukup responsif dalam membantu menyelesaikan permasalahan warga. Semoga Posyankumhamdes Tabanan menjadi percontohan bagi desa/kelurahan lainnya,&rdquo; kata Kristomo.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Selain Widodo dan Kristomo, turut hadir dalam kegiatan tersebut Kepala Divisi Pelayanan Hukum dan HAM Bali Alexander Palti, Kabag Hukum Kabupaten Tabanan I Nyoman Mardiana, Perbekel Desa Gubug I Nengah Mawan, Ketua Posyankumhamdes Desa Gubug I Wayan Suwitra beserta anggotnya, Penyuluh Hukum Kanwil Bali dan perangkat Desa Gubug.</p>\r\n\r\n<p>Perbekel Desa Gubug (I Nengah Mawan) menyampaikan ucapan selamat datang dan ucapan terima kasih atas berkenannya Bapak Kepala Badan Pembinaan Hukum Nasional, beserta jajaran telah berkenan berkunjung ke Desa Gubug dan lebih lanjut menyatakan bahwa dengan terbentuknya posyankumhamdes, &nbsp;kami merasa sangat terbantu dalam menyelesaikan permasalahan hukum secara musyawarah mufakat dengan melakukan mediasi, karena kami selalu dibina dan didampingi oleh Penyuluh hukum Kanwil Hukum dan Ham Provinsi Bali, Kabag Hukum Kabupaten Tabanan dan Camat Tabanan. &nbsp;&nbsp;Terlebih lagi kehadiran Posyankumhamdesa tepat saat adanya wabah covid-19, dimana banyak masyarakat mengalami keterpurukan ekonomi, yang mendorong munculnya berbagai permasalahan di masyarakat.</p>\r\n\r\n<p>Nengah Mawan menambahkan bahwa dari sejak terbentuknya posyankumhamdes di desa gubug, sudah cukup banyak menangani permasalahan/kasus yang dihadapi oleh mayarakat seperti kasus sengketa tanah, hutang piutang, KDRT, Perceraian, Pengancaman, kasus tata Kelola air di Subak dan lain-lainnya.&nbsp; Astunkara dari kasus yang ada sebagian besar dapat dimediasi dengan baik dan berakhir secara damai. &nbsp;Nengah Mawan juga menyampaikan bahwa desa Gubug di tahun 2023 ini mengikuti program Paralegal Justice Award yang dilaksanakan oleh Kementrian Hukum dan Ham RI. 51**</p>', 'pic_1683562121_imageberita.jpg', 'kepala-badan-pembinaan-hukum-nasional-bphn-kunjungi-posyankumhamdesa-desa-gubug-kecamatan-tabanan-kabupaten-tabanan-provinsi-bali-BRT-20230508160600', '2023-05-08', '2023-05-08', NULL),
('BRT-20230509105331', 'USER-20220218110402', 'DESA GUBUG MENDAPAT GILIRAN TERAKHIR DINILAI OLEH TIM EVALUASI PERKEMBANGAN DESA TINGKAT KABUPATEN TABANAN', '<p>Evaluasi Perkembangan Desa dan Kelurahan (Lomdeskel) merupakan suatu upaya penilaian tingkat penyelenggaraaan Pemerintahan, Kewilayahan, dan Kemasyarakatan yang didasarkan pada instrument Evakuasi Perkembangan Desa dan kelurahan guna mengetahui efektifitas dan status perkembangan serta tahapan kemajuan Desa dan kelurahan.</p>\r\n\r\n<p>Bertempat di kantor Desa Gubug, Kecamatan Tabanan, telah dilaksanakan penilaian Lapang Lomba, Evaluasi perkembangan Desa tingkat Kabupaten Tabanan Tahun 2023 (Jumat, 28/04).&nbsp; Kegiatan ini&nbsp; didasari oleh Permendagri Nomor 81 Tahun 2015 tentang Evaluas Perkembangan Desa dan Kelurahan.&nbsp; Kegiatan secara langsung dihadiri langsung oleh Kepala Dinas PMD Kabupaten Tabanan didampingi oleh Camat Tabanan, dan Perbekel Desa Gubug.</p>\r\n\r\n<p>Desa Gubug merupakan satu dari 10 Desa se- Kabupaten Tabanan yang mengikuti lomba evaluasi perkembangan desa tingkat kabupaten tahun 2023. &nbsp;dan Desa Gubug mendapat giliran yang terakhir untuk dinilai. Penilaian dilakukan oleh tim evaluasi perkembangan Desa tingkat Kabupaten Tabanan tahun 2023.</p>\r\n\r\n<p>Perbekel Desa Gubug (I Nengah Mawan) mengucapkan selamat datang kepada rombongan tim evaluasi perkembangan Desa tingkat Kabupaten Tabanan sekaligus menyampaikan rasa tersanjung, dan mewakili semua elemen masyarakat Desa Gubug mengucapkan terima kasih atas diberikan kesempatan mengikuti lomba Evaluasi perkembangan Desa Tingkat Kabupaten tahun 2023 untuk mewakili kecamatan Tabanan.&nbsp; Lebih lanjut dia menyatakan bahwa kesempatan ini dijadikan sebuah momentum untuk melakukan&nbsp; introsepeksi diri dan evaluasi menyeluruh terkait dengan apa yang telah dilakukan selama ini, apakah program dan kegiatan yang dilaksanakan sudah sesuai dan benar kalau dilihat dari sudut regulasi yang ada dan yang lebih penting lagi program dan kegiatan yang dilaksanakan apakah sudah bermanfaat bagi masyarakat Desa Gubug.&nbsp; Untuk itu dia memohon kepada team Evaluasi Perkembangan Desa Tingkat Kabupaten Tabanan tahun 2023 diakhir klarifikasi dan penilaian nanti agar berkenan memberikan apa yang menjadi kelemahan, kekurangan dan kesalahan sehingga dapat dijadikan pedoman untuk melakukan pembenahan dan perbaikan di masa yang akan datang, agar pengelolaan pemerintahan Desa lebih baik, &nbsp;lebih positif&nbsp; dan lebih mandiri dalam mensejahterakan masyarakatnya.</p>\r\n\r\n<p>Kepala Dinas PMD Kabupaten Tabanan (I Gusti Ayu Nyoman Supartiwi) dalam sambutannya menyampaikan ucapan terima kasih kepada seluruh elemen masyarakat Gubug dibawah koordinasi bapak perbekel, selalu siap dan semangat, walaupun acara ini dimajukan waktunya masih tetap bisa. Lomba Desa merupakan kegiatan rutin setiap tahun sesuai amanat Permendagri nomor 81 tahun 2015.&nbsp; Walaupun kegiatan rutin diharapkan semua desa tetap siap dan besemangat, seperti perbekel desa Gubug.&nbsp; Evaluasi Perkembangan Desa &nbsp;hendaknya dijadikan : 1. Sebagai momentum evaluasi dan introspeksi diri seperti yang dikatakan perbekel desa gubug, 2. Untuk melihat kinerja perbekel apakah sudah sesuai dengan tugas dan fungsinya dan 3. Melihat inovasi-inovasi yang dilakukan oleh desa terutama dalam mengangkat potensi desa yang sebesar-besarnya untuk meningkatkan kesejahteraaan dan kemandirian masyarakat. Inovasi adalah menemukan sesuatu hal yang baru atau melakukan berbagai pembaruan yang terbentuk dalam sebuah produk, ide, desain, dan lain sebagainya. Seperti yang kita lihat di ruangan ini, yang mana ruangan ini bukan saja sebagai tempat rapat tapi juga sebagai tempat penyampaian informasi mengenai produk produk yang dihasilkan oleh masyarakat Desa Gubug. Jika ada tamu yang berkunjung ke desa gubug maka secara langsung mengetahui &nbsp;apa saja yang ada di desa gubug.&nbsp;</p>\r\n\r\n<p>Perbekel Desa Gubug (I Nengah Mawan) dalam paparanya mengungkapkan bahwa Desa Gubug sudah termasuk Desa Digital atau smart village, hal ini terbukti dari pengembangan informasi desa sudah dilakukan cukup baik , bukan hanya terbatas pada bidang pembangunan tapi sudah menyakut pelayanan administrasi dan kependudukan, berbagai aplikasi yang berbasiskan teknologi informasi sudah dilaksanakan baik bersumber dari pemerintah maupun pengembangan sendiri. Dalam Efektifitas dan efisiensi pelaksanaan program dan kegiatan untuk meningkatkan kesejehteraaan masyarakat, Pemerintah Desa gubug selalu berbenah mengupayakan dan melaksanakan berbagai inovasi seperti :</p>\r\n\r\n<p>1) <strong>inovasi Berisaku</strong> (Bersih Lestari Desaku) dengan kegiatan pengelolaan sampah rumah tangga dan sampah sejenis sampah rumah tangga,</p>\r\n\r\n<p>2.) <strong>Inovasi Bang Made</strong> (Pengembangan Informasi Desa) dengan kegiatan Manajemen File, Debes, Pengembangan Medsos dan Pod cast Desa;</p>\r\n\r\n<p>3). <strong>Inovasi</strong> <strong>APBDESA </strong>(Angkat Potensi Bersama-sama Desa Sejahtera) dengan kegiatan pertanian kolaborasi, Peningkatan nilai tawar petani, Teknologi New-an, Mewujudkan Prukades dan Prukadus;</p>\r\n\r\n<p>4.) &nbsp;<strong>Inovasi Penetapan HUT dan Atribut Desa</strong>;</p>\r\n\r\n<p>5.) <strong>Inovasi Genting</strong> (Gerakan entaskan stunting),</p>\r\n\r\n<p>6.) <strong>Inovasi Gubug Maco-19</strong> (Gubug aman Covid-19) dan</p>\r\n\r\n<p>7.) <strong>Inovasi Dewi Uma</strong> (Desa Wisata Utamakan kesejahteraan Masyarakat)</p>', 'pic_1683629611_gambar.jpg', 'desa-gubug-mendapat-giliran-terakhir-dinilai-oleh-tim-evaluasi-perkembangan-desa-tingkat-kabupaten-tabanan-BRT-20230509105331', '2023-05-09', '2023-05-09', NULL);
INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20230607035612', 'USER-20220218110402', 'PERBEKEL DESA GUBUG  (Ir. I NENGAH MAWAN) MERAIH ANUGRAH PJA DARI MENKUMHAM RI', '<p>Hari Ulang Tahun lahirnya PANCASILA (1 Juni 2023) di gunakan sebagai hari pemberian anugrah Paralegal Justice Award &nbsp;kepada Kepala Desa/Lurah atau sebutan lainnya yang telah secara nyata berperan sebagai &ldquo;hakim perdamaian&rdquo; dalam penyelesaian konflik, sengketa, yang ada di masyarakat, serta membuat keadaan desa menjadi aman, damai, dan sadar hukum, sehingga tercipta iklim investasi, pariwisata, dan lapangan kerja yang baik di wilayah tersebut.</p>\r\n\r\n<p>Paralegal Justice Award ini merupakan kerja bersama antara Kementerian Hukum dan Hak Asasi Manusia (Kemenkumham) melalui BPHN, Mahkamah Agung (MA) serta didukung oleh Kementerian Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi (Kemendes PDTT) dan Kementerian Dalam Negeri (Kemendagri).</p>\r\n\r\n<p>Kegiatan Paralegal Justice Award diikuti oleh Kepala Desa/Lurah seluruh Indonesia, melalui seleksi yang ketat, hingga terpilih 300 kepala desa/Lurah dan &nbsp;Kegiatan berlangsung dari tanggal 29 &ndash; 31 Mei 2023.</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"height:255px; width:326px\" /></p>\r\n\r\n<p><strong>Ada Tiga apresiasi yang dianugrahkan meliputi 1. Non Litigation Peacemaker (NL.P), 2.&nbsp; Anubhawa Sasana Desa/Kelurahan Jagaddhita dan 3.&nbsp; PJA (Paralegal Justice Award).&nbsp; Non Litigation Peacemaker (NL.P)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n\r\n<p>Apresiasi yang diberikan kepada Kepala Desa/Lurah yang berperan dalam mendamaikan berbagai persoalan hukum warganya dengan cara memediasi, menegosiasi, serta dan melakukan kegiatan penyuluhan hukum, konsultasi hukum, serta membuat kantor desa/kelurahan sebagai pusat informasi, balai musyawarah dalam menyelesaikan persoalan-persoalan hukum warganya.&nbsp; Legalitas NL.P jelas tertuang dalam SK Menkumham yg menjadi dasar untuk keluarnya Piagam NL.P. Adapun dalam Piagam tidak disebutkan gelar bukan berarti BPHN Kemenkumham dan MA tidak mengakui itu sebagai Gelar, selayaknya gelar Haji (muslim) disematkan pada setiap awalan nama Muslim Berhaji meskipun tiada Piagam atau SK Berhaji. Maka NL.P dapat dkenakan pada setiap Kades/Lurah yg meraih PJA dan NL.P. Prinsip yg dipegang oleh BPHN Kumham terhadap Kades/Lurah yg memiliki tugas mulia sebagai Paralegal ialah Profesional walaupun bukan Profesi Karena Profesi berkaitan dengan BNSP dan Kemenakertrans serta K/L terkait lainnya. Maka dari yangg kita kedepankan oleh BPHN Kumham dan MA adalah Perannya yg bersifat Volunteer;</p>\r\n\r\n<p><strong>Anubhawa Sasana Desa/Kelurahan Jagaddhita</strong></p>\r\n\r\n<p>Apresiasi yang diberikan kepada Desa/Kelurahan yang telah menyukseskan dan mengembangkan program pemberdayaan masyarakat dalam rangka pemulihan ekonomi nasional dengan fokus terhadap kemudahan berinvestasi, peningkatan sektor pariwisata dan pembukaan lapangan kerja dengan tetap mempertahankan kearifan lokal dan adat-istiadat setempat. Legalitas ASDJ pun sama dengag NL.P berdasarkan SK dan Piagam dengan kriteria penilaian terhadap Desa/Kelurahannya mendorong pertumbuhan ekonomi yg berbeda dg NL.P yg mana penilaiannya terhadap prestasi Kades/Lurahny dalam perdamaian di Desa;</p>\r\n\r\n<p><strong>3. PJA</strong> <strong>(Paralegal Justice Award)</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Penghargaan yg dberikan kepada Kades/Lurah yg meraih NL.P dan Desa/Kelurahannya yg meraih ASDJ. Karena PJA merupakan penghargaan bagi keduanya baik NL.P dan ASDJ, maka selain Piala diberikan Pin NL.P dan Medali ASDJ;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"height:348px; width:303px\" /></p>\r\n\r\n<p>Ucapan Selamat diberikan kepada Perbekel Desa Gubug (<strong>Ir.I Nengah Mawan, NL.P</strong>) atas anugrah yang diraih, dan semoga bermanfaat bagi &nbsp;diri, keluarga dan masyarakat Desa Gubug.@51**</p>\r\n\r\n<p>&nbsp;</p>', 'pic_1686110172_pic.jpg', 'perbekel-desa-gubug-ir-i-nengah-mawan-meraih-anugrah-pja-dari-menkumham-ri-BRT-20230607035612', '2023-06-07', '2023-06-07', NULL);
INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20230621045536', 'USER-20220218110402', 'Penilaian Lomba Desa Tingkat Provinsi Bali Tahun 2023 Di Desa Gubug, Tabanan', '<p>Kepala Dinas PMD Kabupaten Tabanan, (<strong>Dra.I G.A,N Supartiwi, M.Si</strong>). didampingi oleh Camat Tabanan (<strong>I Gst. Md Darma Ariantha, SSTP, M.Si</strong>) menyambut Tim Penilai Lomba Desa Dan Kelurahan Tingkat Provinsi Bali Tahun 2023 dalam rangka Klarifikasi Lapangan Lomba Desa dan Kelurahan Tingkat Provinsi Bali yang bertempat di Ruang Rapat Kantor Desa Gubug, Kecamatan Tabanan. Senin (19/6/2023).</p>\r\n\r\n<p><br />\r\nDesa Gubug Kecamatan Tabanan masuk dalam penilaian 3 (tiga) Desa Terbaik Tingkat Provinsi Bali &nbsp;Tahun 2023 setelah menjalani penilaian administrasi serta ekspose Kepala Desa di Tingkat Provinsi Bali. Kegiatan ini dilaksanakan untuk klarifikasi lapangan oleh Tim Penilai dari Provinsi Bali. Tim Penilai bejumlah 10 (sepuluh) orang dengan diketuai oleh <strong>Bapak Drs. Si Ngurah Made Arya Astawa, M.Si</strong> &nbsp;serta 9 (Sembilan) orang anggota. Penyambutan dilakukan secara sederhana tanpa seremonial yang diawali dengan pengalungan bunga oleh Kepala Desa Gubug untuk Ketua Tim Penilai yang disaksikan secara langsung oleh Kepala Dinas PMD bersama Camat Tabanan.</p>\r\n\r\n<p><br />\r\nDalam sambutanya Kepala Dinas PMD Kabupaten Tabanan mengucapkan selamat datang kepada Tim Penilai di Desa Gubug Kepala dinas PMD Kabupaten Tabanan juga mengapresiasi dan memberikan penghargaan setinggi-tingginya kepada Pemerintah Desa Gubug yang telah berjuang dengan penuh semangat &nbsp;dan Penuh Kebersamaan dengan lapisan Masyarakat Desa Gubug, untuk mengikuti lomba desa, mulai dari Tingkat Kecamatan, Tingkat Kabupaten Tabanan serta Tingkat Provinsi Bali. &ldquo;Semoga kerja keras Desa Gubug dapat membawa Desa Gubug menjadi juara 1 Tingkat Provinsi mewakili Bali &nbsp;ke Tingkat Nasional,&rdquo; jelasnya.</p>\r\n\r\n<p><img alt=\"\" src=\"https://desagubug.com/gambar/pic_1687324607_20230619_092015.jpg\" style=\"width:70%\" /></p>\r\n\r\n<p><br />\r\nKepala Dinas PMD &nbsp;menambahkan, Lomba Desa Dan Kelurahan Tingkat Provinsi Bali merupakan sebuah sarana untuk mengevaluasi capaian kinerja Perangkat Desa dalam melaksanakan program kerja serta memberikan pelayanan prima kepada warganya. &ldquo;Desa Gubug memiliki visi TRI SEMAYA yang berarti Tiga janji besar yang harus diwujudjkan yaitu Meningkatkan kesejahteraan masyarakat, Mengembangkan Desa Mandiri dan mewujudkan masyarakat yang Berbudaya. Yang mana visi desa Gubug sejalan dengan Visi Kabupaten Tabanan yaitu mewujudkan Tabanan Era Baru yang Aman, Unggul dan Madani (AUM). &nbsp;Saya yakin, dengan potensi Sumber daya Manusia dan Sumber daya alam sedemikian rupa yang dimiliki desa Gubug di tambah dengan kepala desa nya yang enegik dan pekerja keras maka banyak terobosan, &nbsp;inovasi, dan prestasi yang dimiliki oleh Desa Gubug dan hal itu &nbsp;akan menjadi modal utama dalam mencapai hasil yang menggembirakan dalam kompetisi ini,&rdquo; harapnya.</p>\r\n\r\n<p>Ketua team Penilai Lomba Evaluasi perkembangan Desa Tingkat Provinsi Bali tahun 2023 (Kabid Pemdes DPMD dan DUKCAPIL Provinsi Bali) dalam sambutannya mengatakan, dalam Lomba Desa kali ini ada 3 Tahapan, yakni Penilaian Berkas, Paparan Kepala Desa Dan penilaian lapangan. Dimana sebelumnya kami sudah melakukan klarifikasi lapangan ke Desa Eka sari, Kecamatan Melaya, Kabupaten Jembrana dan Desa Tegal Harum kecamatan Denpasar Barat, Kota Denpasar dan kali ini merupakan kunjungan klarifikasi lapangan yang bterakhir di Desa Gubug, Kecamatan Tabanan, Kabupaten Tabanan.</p>\r\n\r\n<p>Untuk penilaian dilapangan kita melihat langsung apa yang menjadi bahan pemaparan Kepala Desa apa sudah sesuai dengan apa yang sudah dipaparkan oleh Kepala Desa, mengenai desanya yang menyangkut tiga bidang tersebut yaitu bidang pemerintahan, bidang kewilayahan, dan bidang kemasyarakatan termasuk inovasi-inovasi yang telah dilaksanakan, tandasnya</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'pic_1687323336_20230619_132604.jpg', 'penilaian-lomba-desa-tingkat-provinsi-bali-tahun-2023-di-desa-gubug-tabanan-BRT-20230621045536', '2023-06-21', '2023-06-21', NULL),
('BRT-20230626130053', 'USER-20220218110402', 'DESA GUBUG MERAIH JUARA II LOMBA EVALUASI PERKEMBANGAN DESA TINGKAT PROVINSI BALI TAHUN 2023', '<p>Desa Gubug kembali menorehkan prestasi, kali ini berhasi meraih juara II lomba evaluasi perkembangan Desa Tingkat Provinsi Bali Tahun 2023, yang sebelumnya di Bulan dan tahun yang sama berhasil menerima anugrah Paralegal Justice Award dari Kementrian Hukum dan Ham Republik Indonesia.</p>\r\n\r\n<p>Perbekel Desa Gubug, I Nengah Mawan dikonfirmasi di ruang kerjanya Jumat, (23/6/2023) mengatakan prestasi ini bukan hal yang mudah sebab terdapat beberapa tahapan yang harus dilalui oleh Desa Gubug. &nbsp;Diawali dari Lomba Evaluasi Perkembangan Desa Tingkat Kecamatan, selanjutnya Lomba Evaluasi Perkembangan Desa Tingkat Kabupaten &nbsp;dan berhasil meraih juara I kemudian maju ketingkat Provinsi . Lomba Evaluasi Perkembangan Desa Tingkat Provinsi Bali tahun 2023. Dingkat Provinsi terdiri dari 3 tahap yaitu 1) tahap seleksi; 2) Tahap pemaparan dan &nbsp;3) kemudian dilanjutkan dengan kunjungan.lapangan.&nbsp; Tahap 2 dan 3 khusus diikuti oleh Desa yang lolos ke tiga besar terbaik. Yang dalam hal ini yaitu Desa Eka Sari, Melaya, Jembrana, Desa Gubug, Tabanan dan Desa Tegal arum, Denpasar Barat.</p>\r\n\r\n<p>Hari ini Jumat, 23 Juni 2023, kami baru saja menerima surat dari Dinas PMD dan DUKCAPIL Provinsi Bali tentang pengumuman Hasil &nbsp;Lomba Evaluasi Perkembangan Desa Tingkat Provinsi Bali Tahun 2023 yang menetapkan dan memutuskan bahwa Desa Tegal Arum, Denpasar Barat sebagai juara I, Desa Gubug, Tabanan sebagai Juara II dan Desa Eka Sari, Melaya, Jembrana sebagai Juara III. Dengan adanya Keputusan ini sekaligus menghentikan langkah kami untuk bisa tampil di tingkat Nasional dan kami harus puas sebagai Juara II.&nbsp; Hal ini&nbsp; kami pikir bahwa masih ada kelemahan dan kekurangan kami di banding dengan desa Tegal arum, kemudian &nbsp;kelemahan dan kekurangan ini kami akan evaluasi untuk perbaikan atau pembenahan dimasa yang akan datang.</p>\r\n\r\n<p>Kami tetap bersyukur walaupun sebagai Juara II, Keberhasilan ini tidak lepas dari dukungan dari BPD, LKD, LAD dan seluruh masyarakat Desa Gubug dan juga pihak pemerintah Kabupaten serta Kecamatan. Mawan berharap prestasi ini bisa memberikan semangat baru dan lebih dapat saling bersinergi dengan jajaran terkait dalam meningkatkan prestasi bagi Perangkat Desa, BPD, LAD, LKD dan seluruh lapisan masyarakat Desa Gubug untuk menyongsong Gubug yang lebih baik dan terwujudnya Gubug Emas tahun 2030.@51**</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'pic_1687784598_pic.jpg', 'desa-gubug-meraih-juara-ii-lomba-evaluasi-perkembangan-desa-tingkat-provinsi-bali-tahun-2023-BRT-20230626130053', '2023-06-26', '2023-06-26', NULL),
('BRT-20231016060241', 'USER-20220218110402', 'Testimoni Tokoh Masyarakat tentang Desa Anti Korupsi', '<p>Video ini menampilkan testimoni dari Tokoh Masyarakat yang memberikan pandangan tentang inisiatif Desa Anti Korupsi, berbagi pengalaman dan pandangan terkait upaya memerangi Korupsi ditingkat Desa. Testimoni ini memberi wawasan mendalam tentang pentingnya kolaborasi masyarakat dan pemerintah dalam menciptakan lingkungan Desa yang bersih dan transparan. Klik link :&nbsp;<a href=\"https://www.facebook.com/100018062138080/videos/3094730144167910/\">https://www.facebook.com/100018062138080/videos/3094730144167910/</a></p>', 'pic_1697436161_Screenshot 2023-10-16 135424.png', 'testimoni-tokoh-masyarakat-tentang-desa-anti-korupsi-BRT-20231016060241', '2023-10-16', '2023-10-16', NULL),
('BRT-20231016061048', 'USER-20220218110402', 'Deklarasi Perangkat Desa Gubug tentang Desa Anti Korupsi dengan mengamalkan 9 Nilai Prinsip Anti Korupsi', '<p>Deklarasi Perangkat Desa Gubug tentang Desa Anti Korupsi mengedepankan 9 nilai prinsip Anti Korupsi sebagai pilar utama. Inisiatif ini menekankan integritas, transparansi, akuntabilitas, dan partisipasi aktif masyarakat dalam mengatasi korupsi di tingkat Desa. Desa Gubug berkomitmen untuk membangun lingkungan yang bersih, adil, dan bebas dari praktik korupsi, memperkuat tata kelola yang baik, serta meningkatkan kualitas hidup warganya melalui kebijakan yang berlandaskan nilai-nilai prinsip Anti Korupsi. Klik Link :&nbsp;<a href=\"https://www.facebook.com/100018062138080/videos/358384466575149/\">https://www.facebook.com/100018062138080/videos/358384466575149/</a></p>', 'pic_1697436648_Screenshot 2023-10-16 140858fff.png', 'deklarasi-perangkat-desa-gubug-tentang-desa-anti-korupsi-dengan-mengamalkan-9-nilai-prinsip-anti-korupsi-BRT-20231016061048', '2023-10-16', '2023-10-16', NULL),
('BRT-20240129055528', 'USER-20220218110402', 'BPD DESA GUBUG GELAR MUSYAWARAH DESA TERKAIT LPPD DAN LPRP-APBDesa TAHUN 2023', '<p>Laporan keterangan pertanggungjawaban adalah laporan berupa laporan keterangan &nbsp;penyelenggara pemerintahan selama satu tahun anggaran atau akhir masa jabatan yang disampaikan oleh Perbekel. Maka dari itu BPD Desa Gubug Kecamatan Tabanan, Kabupaten Tabanan, mengadakan Musyawarah Desa (Musdes) Laporan Keterangan Penyelenggaraan Pemerintah Desa (LPPD) dan Laporan Pertanggung Jawaban&nbsp; realisasi Anggaran Pendapatan dan Belanja Desa (LPRP-APBDes) tahun 2023. Kegiatan yang dilaksanakan pada hari Sabtu, 27 Januari 2024 di Aula kantor Desa Gubug yang dihadiri oleh Bhabinsa dan Bhabinkantibmas, Badan Permusyarawatan Desa (BPD), Perangkat Desa, keterwakilan perempuan, serta tokoh-tokoh masyarakat setempat. Pada kesempatan ini, Pemerintah Desa melakukan pemaparan terkait pelaksanaan penyelaenggaraan pemerintah desa di tahun 2023 dan uraian pendapatan dan belanja desa, yang dilaksanakan tahun 2023. APBDes yang bersumber dari pendapatan asli desa, pendapatan transfer termasuk Dana Desa (DD) dan Alokasi Dana Desa (ADD) serta BKK dari pemerintah Provinsi dan Kabupaten serta pendapatan lain desa.</p>\r\n\r\n<p>Adapun tujuan dari Musdes ini merupakan salah satu mekanisme sebagai bentuk transparansi dan menjamin akuntabiltas pengelolaan keuangan desa, sebagaimana ditegaskan dalam asas Pengelolaan Keuangan Desa (Asas Akuntabel). Hakikat dari pelaporan ini adalah Pengelolaan Keuangan Desa dapat dipertanggung-jawabkan dari berbagai aspek baik secara hukum, administrasi, maupun moral. Pelaporan pengelolaan keuangan desa menjadi kewajiban Pemerintah Desa sebagai bagian tak terpisahkan dari penyelengaraan pemerintahan desa, dalam upaya mewujudkan Visi-Misi Desa yaitu TRI SEMAYA (mewujudkan masyrarakat SEJAHTERA, mengembangkan desa MANDIRI yang&nbsp; BERBUDAYA.</p>\r\n\r\n<p>@51</p>', 'pic_1706507744_WhatsApp Image 2024-01-27 at 09.46.58 - Copy.jpeg', 'bpd-desa-gubug-gelar-musyawarah-desa-terkait-lppd-dan-lprp-apbdesa-tahun-2023-BRT-20240129055528', '2024-01-29', '2024-01-30', NULL),
('BRT-20240202071546', 'USER-20220218110402', 'PEMBINAAN DAN PEMBEKALAN SAT LINMAS MENJELANG PEMILU SERENTAK', '<p>Menjelang pelaksanaan Pemilihan Umum (Pemilu) serentak 2024, Pemerintah Desa Gubug memberikan Pembinaan dan pembekalan kepada Sat Linmas di Desa Gubug tentang tugas-tugas Linmas pada Pemilu 2024 (Rabu, 31 Jan 2024)</p>\r\n\r\n<p>Kegiatan ini dihadiri oleh Kepala Desa Gubug, Bhabinkantibmas Desa Gubug, Kepala Kewilayahan se Desa Gubug dan Seluruh Sat Litmas Desa Gubug. Sedangkan Bhabinsa Desa Gubug dari sejak awal beliau siap hadir namun pada hari bersamaan beliau mendapat tugas, terkait hal yang sama di Renon Denpasar.</p>\r\n\r\n<p>Perbekel Desa Gubug menyampaikan, Pembinaan ini adalah fungsi perlindungan masyarakat (Linmas) yang berkaitan dengan Pemilihan Umum tahun 2024, melalui pembinaan &nbsp;ini diharapkan para Linmas mampu menjaga dan mempertahankan keamanan di Desa Gubug dan agar lebih siap mengantisifasi, menekan dan menyelesaikan segala potensi konflik yang terjadi utamanya dalam pesta demokrasi mendatang</p>\r\n\r\n<p>Bhabinkantibmas Desa Gubug berharap sosialisasi dan pembekalan yang diberikan dapat diterima para Satuan Perlindungan Masyarakat (Sat Linmas) yang nantinya akan diaplikasikan di lapangan saat bertugas. &rdquo; Kegiatan ini sangat penting bagi para satuan Linmas di Desa terutama pada tahun pemilu ini yang rentan terjadi gesekan. Sehingga para anggota Linmas dapat berperan aktif untuk membantu menyelesaikan dan menekan terjadinya gesekan di masyarakat, &nbsp;Harapan kami tentu keberadaan fungsi Linmas yang ada di Desa ini ke depan dapat meningkatkan kesadaran masyarakat untuk terlibat langsung baik dalam penanggulangan bencana, membantu dalam rangka kegiatan sosial kemasyarakatan, maupun kegiatan yang ada di masyarakat dalam rangka penyelesaian perselisihan di masyarakat.</p>\r\n\r\n<p>Pada kesempatan tersebut Pemerintah Desa Gubug juga menyerahkan bantuan pakaian linmas berupa baju kaos, celana training dan sepatu kepada anggota linmas yang pengadaannya bersumber dari APBDesa Desa Gubug Tahun 2024</p>\r\n\r\n<p>@51</p>', 'pic_1706858146_WhatsApp Image 2024-02-02 at 14.55.32.jpeg', 'pembinaan-dan-pembekalan-sat-linmas-menjelang-pemilu-serentak-BRT-20240202071546', '2024-02-02', '2024-02-06', NULL),
('BRT-20240313040112', 'USER-20220218110402', 'Penjabat (Pj) Gubernur Bali, S. M. Mahendra Jaya tinjau TPS V Desa Gubug,  H-1 pada Selasa (13/2/2024).', '<p>Pj. Gubernur dalam kesempatan tersebut mengharapkan partisipasi tinggi masyarakat Bali,&nbsp; mengajak masyarakat untuk datang dan menggunakan hak suaranya dalam Pemilihan Presiden dan anggota Dewan Perwakilan Rakyat RI dan Daerah serta DPD RI yang akan dilaksanakan pada Rabu, 14 Februari.&nbsp;&nbsp;<br />\r\nLain dari itu, Pj. Gubernur Bali Mahendra Jaya juga memberikan masukan terhadap TPS V Desa Gubug diantaranya &nbsp;jarak antar bilik yang masih terlalu dekat, pengaturan atau setting tempatnya tidak transparan. Hal ini untuk menghindari terjadinya kecurangan karena akan menimbulkan kerawanan. &ldquo;Tentu kita ingin agar masyarakat yang menggunakan hak pilihnya merasa nyaman dan tidak merasa terintimidasi di TPS,&rdquo; .&nbsp;&nbsp; &nbsp;<br />\r\nPj. Gubernur pun juga menegaskan kembali komitmen untuk menjaga netralitas ASN di Bali, namun tetap menggunakan hak pilihnya secara bertanggung jawab. &ldquo;Saya juga menugaskan kepala-kepala OPD untuk mendukung dan memonitor wilayahnya masing-masing, agar Pemilu ini&nbsp; berjalan aman lancar dan damai,&rdquo; katanya lagi. &nbsp;<br />\r\nPJ Gubernur, punya target besar dari KPU yakni partisipasi pemilih hingga 83 persen lebih tinggi dari target nasional yakni 80 persen. Selain itu, targetnya juga agar pemilu di Bali berjalan dengan baik, minim kesalahan sehingga tidak menimbulkan gugatan kedepannya. &ldquo;Jadi kita support dan dukung ini, saya apresiasi kerja keras KPU, Bawaslu, aparat keamanan yang luar biasa dan kita harapkan dua target besar ini bisa tercapai<br />\r\nDalam peninjauannya, rombongan Pj Gubernur Bali di TPS 005, Banjar Tonja, Desa Gubug, Tabanan memastikan kelengkapan di tiap TPS seperti meja pencatat kehadiran pemilih, tempat duduk pemilih untuk menunggu giliran mencoblos, bilik suara (tempat pemilih mencoblos) hingga tempat kotak suara.<br />\r\nTidak lupa, Penjabat Gubernur Bali Mahendra Jaya memastikan agar petugas KPPS selalu dalam kondisi badan dan pikiran yang sehat dan fit, guna dapat menjalankan tugas dan tanggung jawabnya dengan baik hingga penghitungan suara selesai.</p>\r\n\r\n<p>@51</p>', 'pic_1710302472_WhatsApp Image 2024-03-04 at 10.36.54.jpeg', 'penjabat-pj-gubernur-bali-s-m-mahendra-jaya-tinjau-tps-v-desa-gubug-h-1-pada-selasa-13-2-2024-BRT-20240313040112', '2024-03-13', '2024-03-13', NULL),
('BRT-20240404050303', 'USER-20220218110402', 'Pelatihan Kader Posyandu dalam Rangka Pecegahan dan Penurunan Angka Stunting di Desa Gubug', '<p>Dalam upaya meningkatkan kapasitas kader Posyandu di Desa Gubug&nbsp; pada hari rabu 3 April melaksanakan pelatihan bagi kader Posyandu. Pelatihan yang berlangsung di&nbsp; Aula Kantor desa Gubug. &nbsp;Yang dihadiri oleh Perbekel desa Gubug, BPD desa Gubug, Pengurus TP PKK desa Gubug, Kader KPM, Kader Posyandu Balita dan Remaja serta Narasumber dari Dinas Kesehatan Kabupaten Tabanan ( Ida Ayu Mirah R, S.Gz) dan PUSKESMAS Tabanan 1 (Ni Putu Sumarheni)</p>\r\n\r\n<p>Perbekel Desa Gubug, dalam sambutannya mengatakan bahwa Posyandu memiliki peran yang strategis dalam upaya mewujudkan kesehatan masyarakat dan program nasional Konvergensi Stunting di Desa. Sesuai dengan tujuan dibentuknya Posyandu yang merupakan garda utama layanan dasar kesehatan adalah untuk percepatan penurunan angka kematian ibu dan anak, maka sasaran Posyandu bukan saja pada balita saja, tetapi juga ibu hamil, ibu menyusui dan ibu nifas,&rdquo;.</p>\r\n\r\n<p>Ditambahkan , bawha Posyandu dengan 5 meja layanannya yang menjadikan prioritas dan intervensi layanan harus dijabarkan dan diaplikasikan dinilai memberikan kontribusi yang besar dalam upaya penanganan stunting di desa. Dengan pemantauan pertumbuhan dan perkembangan bayi dan balita melalui pengisian kurva KMS, balita yang mengalami permasalahan pertumbuhan dapat dideteksi sedini mungkin, sehingga tidak terjadi stunting.</p>\r\n\r\n<p>&ldquo;Saya harap para peserta mengikuti kegiatan pelatihan ini dengan seksama sehingga dapat memahani seluruh materi yang disampaikan para narasumber sebagai bekal melaksanakan kegiatan di Dusun masing-masing. Perbekel Desa Gubug&nbsp; juga mengingatkan kepada seluruh peserta bahwa tidak ada pribadi atau lembaga di desa secara mandiri yang dapat menangani permasalahan stunting, perlu sinergitas dari seluruh pihak.</p>\r\n\r\n<p>&ldquo;Kepada seluruh kader Posyandu, saya berpesan agar meningkatkan koordinasi dengan seluruh pegiat pemberdayaan masyarakat dan pelaku pembangunan desa seperti guru PAUD, kader kesehatan, unit layanan kesehatan,&nbsp; kader PKK, Karang Taruna, tokoh masyarakat, dan berbagai kelompok masyarakat yang peduli dalam upaya pencegahan stunting. Tanpa sinergitas, maka kegiatan pencegahan stunting di desa akan semakin berat dilaksanakan,&rdquo; jelasnya lagi.</p>\r\n\r\n<p>Ketua BPD Desa Gubug mengucapkan terima kasih kepada para Kader Kesehatan Desa, yang selama ini telah memberikan kepada masyarakat Desa Gubug khususnya kepada balita dan ibu hamil dan ia berjanji akan memerjuangkan segala aspirasi Kader Kesehatan desa melalui Musyawarah yang dilaksanakan Di tingkat Desa.</p>\r\n\r\n<p>&ldquo;Tujuan dilaksanakannya pelatihan ini adalah meningkatkan pengetahuan dan keterampilan kader posyandu dalam hal Pencatatan dan Pelaporan (SIP), Pelaksanaan Paket Layanan Pencegahan Stunting di Desa, Peran PAUD dalam Konvergensi Stunting, Pemanfaatan Dana Desa untuk Pembangunan Kesehatan serta Tugas KPM dalam Penanganan Konvergensi Stunting di Desa, Melalui kegiatan ini diharapkan para kader posyandu akan semakin terlatih dan terampil dalam melaksanakan kegiatan rutin Posyandu di desa, sehingga peran Posyandu dalam upaya konvergensi pencegahan stunting makin meningkat, dan ujung-ujungnya stunting dapat ditekan/diturunkan bahkan Desa bebas dari stunting.</p>\r\n\r\n<p>@51**</p>', 'pic_1712206983_WhatsApp Image 2024-04-03 at 11.28.31.jpeg', 'pelatihan-kader-posyandu-dalam-rangka-pecegahan-dan-penurunan-angka-stunting-di-desa-gubug-BRT-20240404050303', '2024-04-04', '2024-04-04', NULL),
('BRT-20240404054056', 'USER-20220218110402', 'REMBUG STUNTING TAHUN 2024', '<p><strong>R</strong><strong>embuk stunting</strong> Desa merupakan rangkaian pertemuan yang dilakukan Desa dalam rangka membahas hasil perumusan kegiatan melalui diskusi terarah (Focus Group Discussion) untuk membuat membahas dan menetapkan komitmen Desa dalam menetapkan program atau kegiatan pencegahan dan penanganan konvergensi stunting Desa.</p>\r\n\r\n<p>Dalam kesempatan Rembug Stunting yang dilaksanakan pada hari ini, Rabu 3 April 2024, Pemerintah Desa Gubug melakukan kegiatan guna mendukung program pemerintah dalam mencegah gejala stunting. Kegiatan ini juga dihadiri oleh Perbekel Gubug, BPD Gubug, Ketua dan Pengurus TP PKK Desa Gubug, beserta KPM dan seluruh Kader Posyandu balita dan Remaja Desa Gubug</p>\r\n\r\n<p>Rembug Stunting di Desa Gubug merupakan sebuah forum partisipatif yang melibatkan pemerintah desa, tokoh masyarakat,&nbsp; lembaga pendidikan, kader kesehatan, serta warga desa secara umum. Tujuan utamanya adalah untuk mendiskusikan permasalahan stunting yang ada di Desa Gubug, mengidentifikasi penyebab-penyebabnya, dan merumuskan langkah-langkah konkret yang akan diambil dalam RKPDes tahun 2025.</p>\r\n\r\n<p>Pada kesempatan tersebut dibahas mengenai kegiatan penting yang harus dilakukan untuk mengkonsolidasi usulan-usulan kegiatan berdasarkan data hasil pemetaan di Desa Gubug oleh Kader Pembangunan Manusia (KPM).&nbsp;&nbsp;Rembug stunting dilakukan melalui diskusi terarah untuk mendapatkan komitmen desa dan menyepakati kegiatan-kegiatan yang akan dilaksanakan untuk memastikan konvergensi baik yang akan dilakukan pada tahun berjalan maupun untuk dimasukkan dalam RKPDesa tahun berikutnya.&nbsp;</p>\r\n\r\n<p><strong>Langkah-langkah Strategis &nbsp;konvergensi penanganan stuting untuk Penyusunan RKPDes 2025</strong></p>\r\n\r\n<p>Hasil dari Rembug Stunting Desa Gubug akan menjadi dasar dalam penyusunan RKPDesa tahun 2025.</p>\r\n\r\n<p>&nbsp;Dalam acara tersebut, peserta Rembug Stunting aktif berpartisipasi dalam diskusi dan pemetaan masalah stunting di Desa Gubug Berbagai aspek terkait stunting diperdebatkan dan didiskusikan dengan tujuan mencari solusi yang terbaik. Beberapa topik utama yang dibahas antara lain:</p>\r\n\r\n<ol>\r\n	<li>Pendidikan dan pengetahuan gizi: Peserta Rembug Stunting memperdebatkan pentingnya meningkatkan pendidikan dan pengetahuan gizi yang baik, termasuk pemahaman tentang pola makan yang seimbang dan pemberian makanan bergizi kepada anak-anak. Diskusi ini melibatkan peran lembaga pendidikan, tokoh masyarakat, dan kader kesehatan.</li>\r\n	<li>Ketersediaan pangan berkualitas: Masalah akses terhadap pangan yang berkualitas dan beragam di tingkat rumah tangga menjadi fokus utama dalam diskusi. Peserta Rembug Stunting berusaha mencari solusi untuk memastikan bahwa setiap keluarga di Desa Gubug memiliki akses terhadap pangan yang sehat dan bergizi.</li>\r\n	<li>Akses pelayanan kesehatan: Peran bidan desa, pengurus posyandu, dan pelayanan kesehatan di Desa Gubug sangat penting dalam mencegah dan menangani stunting. Diskusi berfokus pada langkah-langkah untuk meningkatkan akses dan kualitas pelayanan kesehatan, termasuk pemeriksaan kehamilan dan perawatan anak balita.</li>\r\n	<li>Peningkatan sanitasi dan higiene: Peserta Rembug Stunting sepakat bahwa sanitasi dan higiene yang baik merupakan faktor penting dalam pencegahan stunting. Diskusi difokuskan pada langkah-langkah untuk meningkatkan sanitasi di rumah tangga dan lingkungan sekitar, termasuk kampanye kesadaran masyarakat dan pembangunan fasilitas sanitasi yang memadai.</li>\r\n</ol>\r\n\r\n<p>Dari diskusi yang melibatkan semua peserta Rembug Stunting, sejumlah langkah strategis berhasil dirumuskan. Langkah-langkah ini akan menjadi dasar dalam penyusunan Rencana Kerja Pemerintah Desa (RKPDes) tahun 2025. Beberapa langkah strategis yang diusulkan antara lain:</p>\r\n\r\n<ol>\r\n	<li>Meningkatkan penyuluhan dan pendidikan gizi kepada masyarakat, khususnya ibu hamil dan balita.</li>\r\n	<li>Mengadakan pelatihan bagi ibu-ibu di Desa Gubug dalam hal pemilihan, pengolahan, dan pemberian makanan bergizi kepada anak-anak.</li>\r\n	<li>Mendorong produksi pangan lokal yang berkualitas melalui program pertanian berkelanjutan dan pemberian bantuan kepada petani.</li>\r\n	<li>Memperkuat kerjasama antara posyandu, bidan desa, dan rumah sakit setempat untuk meningkatkan pelayanan kesehatan ibu dan anak.</li>\r\n	<li>Melakukan kampanye kesadaran masyarakat tentang pentingnya sanitasi dan higiene, serta meningkatkan akses terhadap fasilitas sanitasi yang memadai.</li>\r\n</ol>\r\n\r\n<p>Melalui Rembug Stunting ini, Desa Gubug menunjukkan komitmen yang kuat dalam menghadapi masalah stunting dan mencari solusi yang berkelanjutan. Dengan melibatkan berbagai pihak terkait, diharapkan RKPDes tahun 2025 akan mengimplementasikan langkah-langkah strategis yang efektif dalam pencegahan dan penanggulangan stunting di Desa Gubug</p>\r\n\r\n<p>@51**</p>', 'pic_1712209256_WhatsApp Image 2024-04-03 at 11.28.34.jpeg', 'rembug-stunting-tahun-2024-BRT-20240404054056', '2024-04-04', '2024-04-04', NULL),
('BRT-20240502042441', 'USER-20220218110402', 'DESA GUBUG MELAKSANAKAN PENERTIBAN PENDUDUK PENDATANG/NON PERMANEN', '<p>Dalam rangka penertiban administrasi kependudukan Di Desa Gubug, Kecamatan Tabanan, Kabupaten Tabanan melaksanakan pemantauan dan pendataan penduduk non permanen, Hari Rabu, Tanggal 1 april 2024. Penertinban penduduk pendatang/non permanen tersebut diikuti oleh Perbekel Desa Gubug, Ketua BPD Desa Gubug, Babinsha, Babinkantibmas Desa Gubug, Linmas Desa Gubug dan Pecalang banjar Adat se Desa Gubug. Kegiatan diawali dengan Apel kesiapan bagi para pesrta.</p>\r\n\r\n<p>Pada kesempatan tersebut perbekel desa gubug mengatakan bahwa Maksud dan tujuan pelaksanaan penertiban penduduk pendatang ini adalah untuk mewujudkan tertib administrasi bagi penduduk pendatang/non permanen baru di wiliyah desa Gubug dan menjaga keamanan tentunya.&nbsp; Hal ini dilakukan sebagai langkah antisipasi terhadap &nbsp;gangguan kantibmas.</p>\r\n\r\n<p>Babinkantibmas Desa Gubug (I Wayan Sugiarta) menghimbau para peserta agar dalam melaksanakan tugas atau kewajiban hendaknya penuh kehati-hatian dan dengan mengedepankan pendekatan secara humanis, agar jangan sampai menimbulkan konplik dengan warga. Beliau menekankan pentingnya menjaga keamanan dan ketertiban, beliau menambahkan pentingnya sinergi antara tiga pilar dan masyarakat dalam menjaga ketertiban dan keamanan wilayah Desa Gubug &nbsp;dan agar semangat kerjasama ini terus ditingkatkan untuk menjaga kondusifitas keamanan .</p>\r\n\r\n<p>Dalam melakukan penertiban penduduk pendatang di Wilayah Desa Gubug, terjaring warga yang belum tercatat sebanyak 244. &nbsp;Selain melakukan pendataan, pemerintah Desa Gubug &nbsp;memberikan himbauan kepada penduduk non permanen untuk membuat Surat Keterangan Tinggal Sementara (SKTS). Adapun pembuatan SKTS sendiri dapat dilakukan melalui pendaftaran langsung ke kantor Desa.</p>\r\n\r\n<p>@51**</p>', 'pic_1714623881_WhatsApp Image 2024-05-01 at 21.23.00.jpeg', 'desa-gubug-melaksanakan-penertiban-penduduk-pendatang-non-permanen-BRT-20240502042441', '2024-05-02', '2024-05-02', NULL),
('BRT-20240808012059', 'USER-20220218110402', 'MAHASISWA UNIVERSITAS UDAYANA KKN DI DESA GUBUG', '<p>&nbsp;Selamat Datang Kepada Mahasiswa KKN (Kuliah Kerja Nyata) UNUD Denpasar di Desa Gubug, Kecamatan Tabanan Kabupaten Tabanan yang tercinta ini,&nbsp;Saya selaku kepala Desa Gubug sangat berterima kasih dengan kedatangan para Mahasiswa KKN UNUD di desa kami ini, Hal-hal yang berkaitan dengan keberadaan Mahasiswa KKN di desa ini adalah tanggung jawab desa, karena mahasiswa saat ini berada dalam ruang &nbsp;lingkup desa, meskipun hanya 5 minggu saja, maka dari itu kami berharap agar adik - adik mahasiswa &nbsp;membantu kegiatan dan program desa, memberikan informasi atau laporan kepada desa dari penelitian yang didapat, dan jika ada kekurangan &nbsp;pelayanan dari desa ataupun aparat desa kami mohon maklum adanya, akan tetapi pada prinsipnya kami merasa berterima kasih atas kedatangan para mahasiswa KKN UNUD di desa kami ini.</p>\r\n\r\n<p>Mahasiswa dari UNUD Denpasar ini akan melakukan kegiatan kuliah kerja nyata di Desa Gubug ini dalam waktu 5 minggu, dimulai dari tanggal 15 Juli 2024 &ndash; 26 Agustus 2024, total ada 16 orang mahasiswa dari berbagai fakultas &nbsp;yang berbeda yang di terima di Desa Gubug dengan di dampingi oleh Dosen pendamping.</p>\r\n\r\n<p>Adapun dari pihak pemerintah desa dalam hal ini Perbekel Desa Gubug, Ketua/anggota LPM, Ketua Karang Taruna, Sekretaris Desa dan Staff Kaur sangat senang dan dengan resmi sudah menerima kedatangan mahasiswa UNUD Denpasar untuk melakukan kegiatannya di Desa kami.</p>\r\n\r\n<p>Perbekel Desa Gubug Menekankan kepada seluruh mahasiswa agar selalu mengikuti atauran &ndash; aturan yang sudah diberikan di kampusnya dan aturan &ndash;aturan yang ada di Desa Gubug dalam menjalani kuliah kerja nyata ini.</p>\r\n\r\n<p>Dalam penerimaan mahasiswa KKN UNUD ini, perbekel Desa Gubug langsung memberikan tugas kepada seluruh mahasiswa agar membantu Desa dalam mengembangkan Wisata melalui pokdarwis dan membantu dalam penginputan data SDGS Desa.</p>\r\n\r\n<p><strong>@51</strong></p>\r\n\r\n<p>&nbsp;</p>', 'pic_1723080059_WhatsApp Image 2024-08-01 at 11.30.15.jpeg', 'mahasiswa-universitas-udayana-kkn-di-desa-gubug-BRT-20240808012059', '2024-08-08', '2024-08-08', NULL),
('BRT-20240808012928', 'USER-20220218110402', 'MUSYAWARAH DESA PENYUSUNAN RKPDesa GUBUG TAHUN 2025', '<p>BPD Desa Desa Gubug telah melaksanakan Musyawarah Desa Perencanaan Pembangunan Tahunan dalam rangka Penyusunan Rencana Kerja Pemerintah Desa Tahun Anggaran&nbsp;2025 pada hari sabtu, tanggal 15 Juni 2024, bertempat di ruang rapat kantor Desa Gubug yang dihadiri oleh Camat Tabanan, Babinsa, Bhabinkamtibmas, Anggota BPD, Pendamping Desa dan Lokal Desa, Pemuka Agama Desa, Pemuka Adat Desa, Karang Taruna Desa, LPM, TP.PKK Desa, LAD,&nbsp; Linmas Desa,&nbsp; Ketua Posyandu, Kepala Sekolah Paud Tunas Harapan,&nbsp; Perangkat Desa dan Staf.</p>\r\n\r\n<p>Acara dipimpin oleh Ketua BPD Desa Gubug dalam sambutannya disampaikan RKP Desa merupakan penjabaran dari RPJM Desa yang di turunkan ke RKP Desa. RKP Desa menjadi dasar penyusunan dan penetapan Anggaran Pendapatan dan Belanja Desa (APBDesa).</p>\r\n\r\n<p>Musdes Penyusunan RKPDesa ini dilakukan untuk merancang kegiatan yang akan dilaksanakan di tahun 2025. Agenda Musdes Penyusunan RKPDesa ada 4 hal/agenda yang dilaksanakan sekaligus yang ingin dicapai adalah : (1). Penyampaian Visi-Misi dan Program kerja Pemerintah Desa Gubug oleh Perbekel Desa Gubug, (2). Pokok -pokok pikiran BPD Desa Gubug oleh ketua BPD Desa Gubug,&nbsp; (3). Penyampaian Aspirasi oleh Perwakilan masyarakat yang hadir dan (4). Pembentukan team Verifikasi.</p>\r\n\r\n<p>Perbekel Desa Gubug (I Nengah Mawan) dalam penyampaianya mengatakan bahwa Visi adalah kristalisasi dari nilai - nilai yang dijunjung tinggi, cita-cita dan gambaran ke depan apa yang ingin diwujudkan. Berkaitan dengan itu Visi yang ingin diwujudkan&nbsp; oleh Kepala Desa Gubug adalah <strong>&ldquo; Tri Semaya&rdquo;</strong> (Sejahtera, Mandiri dan berbudaya ) jadi ada tiga janji besar yang ingin diwujudkan yaitu &ldquo;<strong>Mewujudkan&nbsp; masyarakat Sejahtera, Mandiri dan&nbsp; Berbudaya&rdquo;.</strong>&nbsp; Untuk mewujudkan visi yang diinginkan kita harus memiliki misi. Jadi misi adalah tugas dan tanggung jawab yang harus dilaksanakan agar visi dapat terwujud. Misi yang diemban oleh Pemerintah Desa adalah;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a)&nbsp; Peningkatan Kualitas Pemerintahan Desa dan akses terhadap pelayanan dasar masyarakat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;b)&nbsp; Meningkatkan Kesejahteraan dan Kemandirian Masyarakat dengan Memantapkan Pembangunan di Bidang Ekonomi yang kreatif, inovatif dan produktif dengan memanfaatkan teknologi tepat guna;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c)&nbsp; Meningkatkan Pembangunan dan pemeliharaan Infrastruktur&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d)&nbsp; Memantapkan pelestarian Sumber Daya Alam dan Lingkungan &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e)&nbsp; Meningkatkan kualitas Hidup, Ketertiban, Keamanan, Kenyamanan dan Kebudayaan serta Kearifan local.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Pembangunan desa bertujuan meningkatkan kesejahteraan masyarakat desa dan kualitas hidup manusia serta penanggulangan kemiskinan melalui penyediaan pemenuhan kebutuhan dasar, pembangunan sarana dan prasarana, pengembangan potensi ekonomi lokal, serta pemanfaatan sumber daya alam dan lingkungan secara berkelanjutan. Untuk itu, UU Desa menggunakan 2 (dua) pendekatan, yaitu &ldquo;desa membangun&rdquo; dan &ldquo;membangun desa&rdquo; yang diintegrasikan dalam perencanaan pembangunan desa.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pembangunan desa dilaksanakan oleh pemerintah desa dan masyarakat desa dengan semangat gotong royong serta memanfaatkan kearifan lokal dan sumber daya alam desa.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan program sektor yang masuk ke desa diinformasikan kepada pemerintah desa dan diintegrasikan dengan rencana pembangunan desa. Masyarakat desa berhak mendapatkan informasi dan melakukan pemantauan mengenai rencana dan pelaksanaan pembangunan desa. Pembangunan desa merupakan sebagai upaya mempercepat dan meningkatkan kualitas pelayanan, pembangunan, dan pemberdayaan masyarakat desa di kawasan perdesaan melalui pendekatan pembangunan partisipatif. Oleh karena itu, rancangan pembangunan kawasan perdesaan dibahas bersama oleh Pemerintah, pemerintah daerah provinsi, pemerintah daerah kabupaten, dan pemerintah desa. Dimana arah pembangunan desa difokuskan pada pencapaian tujuan pembangunan berkelanjutan atau SDG&rsquo;s.</p>\r\n\r\n<p>Selanjutnya I Ketut Suetra, Ketua Badan Permusyawaratan Desa (BPD) Gubug menyampaikan pokok-pokok pikiran BPD dan memberikan rekomendasi dalam penyusunan RKP Desa tahun 2025 sebagai berikut :</p>\r\n\r\n<ol>\r\n	<li>Penyusunan RKP Desa harus mengacu pada Visi dan misi Kepala Desa dan Pokok-pokok Pikiran BPD.</li>\r\n	<li>Perencanaan pembangunan Desa harus melibatkan masyarakat dalam setiap tahapannya. Keterlibatan masyarakat sebagai wujud partisifasi masyarakat dalam perencanaan pembangunan</li>\r\n</ol>\r\n\r\n<p>Dalam sesi penyampaian aspirasi dari perwakilan masyarakat yang hadir dalam musdes, banyak usulan yang disampaikan.&nbsp; Dari sekian usulan yang berkembang ternyata lebih banyak yang mengusulkan dibidang Pembangunan infras truktur seperti perbaikan jalan, gang, saluran irigasi dan jalan usaha tani serta lain-lainya.&nbsp; Juga ada&nbsp; mengusulkan &nbsp;&nbsp;bidang Pendidikan, bidang Kesehatan menitik beratkan dengan&nbsp; kegiatan posyandu baik Posyandu Balita, Remaja dan Lansia &nbsp;&nbsp;&nbsp;&nbsp;serta banyak lagi usulan yang lainnya.</p>\r\n\r\n<p>Sebagai agenda acara terakhir sebelum penutupan dilakukan pembentukan tim verifikasi dan Musdes telah berhasil menetapkan 4 orang sebagai tim verifikasi sesuai dengan bidang-bidang Bidang pembinaan masyarakat Desa dan 4) Bidang pemberdayaan masyarakat Desa.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>@51**&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>', 'pic_1723080568_WhatsApp Image 2024-06-15 at 11.24.55.jpeg', 'musyawarah-desa-penyusunan-rkpdesa-gubug-tahun-2025-BRT-20240808012928', '2024-08-08', '2024-08-08', NULL),
('BRT-20240813042021', 'USER-20220218110402', 'BPD DESA GUBUG MENGGELAR MUSDES PERUBAHAN RPJMDesa 2019 - 2027', '<p>Rabu, 7 Agustus &nbsp;2024. Pemereintah Desa Gubug mengadakan acara Musyawarah Desa terkait perubahan RPJM menindaklanjuti perpanjangan masa jabatan Perbekel Desa Gubug selama 2 tahun menjadi 8 tahun masa jabatan. Bertempat di Ruang Rapat Kantor Perbekel Desa Gubug yang dihadiri oleh Kepala desa , Babinsa, Bhabinkamtibmas, Anggota BPD, Pengurus LAD&nbsp; dan LKD se- Desa Gubug, dan perngkat Desa serta Staff Desa.</p>\r\n\r\n<p>Ketua BPD Desa Gubug, I Ketut Suetra, menjelaskan bahwa Musdes ini merupakan tahap lanjut dari musyawarah tingkat dusun (Musdus) yang telah dilaksanakan oleh masing-masing dusun di Gubug dalam menggali aspirasi masyarakat. &quot;Musdus ini penting untuk mendengarkan langsung masukan dari masyarakat di setiap dusun. Namun, semua usulan tersebut harus tertuang dalam RPJMDes agar dapat diakomodasi dalam rencana pembangunan desa yang lebih besar,&quot; jelas I Ketut Suetra&nbsp;</p>\r\n\r\n<p>Menurut Kepala Desa Gubug, Nengah Mawan, selambat-lambatnya tiga bulan setelah Pelantiakn perpanjangan masa tugas perbekel, harus sudah melakukan perubahan RPJMDes. &quot;Hal ini penting agar visi dan misi pembangunan desa dapat segera diwujudkan dengan memperbarui rencana kerja yang sesuai dengan kebutuhan dan prioritas terbaru,&quot; ujar Nengah Mawan. Adapun Visi Misi yang disampaikan adalah sebagai berikut :&nbsp; Visi</p>\r\n\r\n<p>Visi adalah kristalisasi dari nilai - nilai yang dijunjung tinggi, cita-cita dan gambaran ke depan apa yang ingin diwujudkan. Berkaitan dengan itu Visi yang ingin diraih&nbsp; oleh Kepala Desa Gubug adalah <strong>&ldquo; Tri Semaya&rdquo; (Sejahtera, Mandiri dan berbudaya )</strong> jadi ada tiga janji besar yang ingin diwujudkan yaitu &ldquo;Mewujudkan&nbsp; masyarakat <strong>Sejahtera,</strong> <strong>Mandiri</strong> dan&nbsp; <strong>Berbudaya</strong>&rdquo; Untuk mewujudkan visi yang diinginkan kita harus memiliki misi. Jadi misi adalah tugas dan tanggung jawab yang harus dilaksanakan agar visi dapat terwujud. Misi yang diemban oleh Kepala Desa adalah;</p>\r\n\r\n<ol>\r\n	<li>\r\n	<ol>\r\n		<li>\r\n		<ol>\r\n			<li>\r\n			<ol>\r\n				<li>Peningkatan Kualitas Pemerintahan Desa dan akses terhadap pelayanan dasar masyarakat</li>\r\n				<li>Meningkatkan Kesejahteraan dan Kemandirian Masyarakat dengan Memantapkan membangunan di Bidang Ekonomi yang kreatif, inovatif dan produktif dengan memanfaatkan teknologi tepat guna;</li>\r\n				<li>Meningkatkan Pembangunan dan pemeliharaan Infrastruktur</li>\r\n				<li>&nbsp;Memantapkan pelestarian Sumber Daya Alam dan Lingkungan</li>\r\n				<li>Meningkatkan kualitas Hidup, Ketertiban, Keamanan, Kenyamanan dan Kebudayaan serta Kearifan local</li>\r\n			</ol>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>Semua peserta musyawarah sepakat untuk mendukung perubahan RPJMDes dan penyusunan sesuai dengan kebutuhan dan prioritas pembangunan desa. Diharapkan dengan perubahan RPJMDes ini, Desa Gubug dapat mencapai target pembangunan yang lebih optimal dan meningkatkan kesejahteraan seluruh warga desa.</p>\r\n\r\n<p><strong>@51**</strong></p>', 'pic_1723522821_WhatsApp Image 2024-08-07 at 11.20.32.jpeg', 'bpd-desa-gubug-menggelar-musdes-perubahan-rpjmdesa-2019-2027-BRT-20240813042021', '2024-08-13', '2024-08-13', NULL),
('BRT-20240910030733', 'USER-20220218110402', 'Upacara Bendera Peringatan HUT Ke-79 Proklamasi Kemerdekaan Indonesia Tahun 2024 di Desa Gubug', '<h1>&nbsp;</h1>\r\n\r\n<p>Peringatan Hari Ulang Tahun Kemerdekaan RI 17 Agustus, diperingati pelaksanaannya disetiap tahunnya. Desa Gubug melaksanakan upacara HUT ke-79 Republik Indonesia di lapangan desa Gubug diikuti Perbekel, Ketua dan anggota BPD Desa Gubug, Perangkat Desa, babinkantibmas seluruh pengurus LKD dan LAD Desa Gubug, Guru dan siswa Sekolah dasar se-Desa Gubug, dan sejumlah siswa SMA/SMK, Sabtu (17/8).</p>\r\n\r\n<p>Pada hari yang cerah ini Sabtu, 17 Agustus 2024 seluruh bangsa Indonesia bersama-sama memperingati hari yang sangat bermakna, yaitu bangsa Indonesia terbebas dari belenggu penjajah. Peringatan HUT ke-79 Kemerdekaan RI tahun 2024 ini mengusung tema besar dengan slogan &ldquo;Nusantara Baru, Indonesia Maju&rdquo;.</p>\r\n\r\n<p>Dalam rangka memperkokoh persatuan dan kesatuan bangsa serta tingkatkan kewasapaan dalam berbagai bentuk ancaman, rintangan demi kelangsungan keutuhan negara kesatuan Republik Indonesia yang berdasar pancasila, merupakan komitmen &nbsp;bersama untuk melanjutkan perjuangan para pahlawan kita, berbuat yang terbaik untuk kemajuan bangsa dan negara tercinta ini. Pada moment ini,&nbsp; seluruh masyarakat khususnya dari Aparatur Pemerintah yang ada dalam wilayah Desa Gubug untuk tingkatkan semangat juang nasionalisme yang dilandasi nilai-nilai perjuangan proklamasi 17 Agustus 1945.</p>\r\n\r\n<p>Tingkatkan rasa persatuan dan kesatuan komponen yang ada untuk mewujudkan visi dan misi pembangunan desa gubug yaitu masyarakat yang Mandiri semakin mantap sesuai Visi desa Tri Semaya yaitu mewujudkan masyarakat Sejahtera, Mandiri &nbsp;dan Berbudaya.&nbsp; Penghargaan setinggi-tingginya kepada para pahlawan&nbsp; bangsa, para pejuang perintis kemerdekaan, para veteran dan para generasi penerus bangsa dan pemimpin negara, daerah provinsi, daerah kabupaten, dan Desa dengan segala upaya perjuangan dalam mempertahankan dan mengisi kemerdekaan ketulusan hati dan pengabdiannya, dengan berbekal rasa percaya diri dan disiplin yang tinggi harapan-harapan tersebut dapat kita wujudkan. Dirgahayu Republik Indonesia semoga Indonesia tetap jaya selama-lamanya, Merdeka, Merdeka, Merdeka<br />\r\n<strong>@51**</strong></p>', 'pic_1725937653_Screenshot 2024-09-10 110541.jpg', 'upacara-bendera-peringatan-hut-ke-79-proklamasi-kemerdekaan-indonesia-tahun-2024-di-desa-gubug-BRT-20240910030733', '2024-09-10', '2024-09-10', NULL),
('BRT-20240910031032', 'USER-20220218110402', 'Perbekel Desa Gubug dalam Acara HUT Desa Gubug : Momentum Refleksi dan Kolaborasi', '<p>Aula&nbsp; Kantor Desa Gubug dipenuhi antusiasme dan kegembiraan undangan saat peringatan Hari Ulang Tahun (HUT) ke-103 Desa Gubug, Kecamatan Tabanan Minggu (18/08/2024).</p>\r\n\r\n<p>Acara tersebut dihadiri oleh undangan, hadir diantaranya Perbekel Desa Gubug, Ketua BPD serta anggota, dosen pendamping dan Mahasiswa KKN UNUD, Babinsa, Babinkantibmas, LKD dan LAD Desa Gubug, Tokoh masyarakat, Tokoh agama dan Mantan Perbekel Desa Gubug atau Perwakilannya serta undangan lainya.</p>\r\n\r\n<p>Dalam sambutannya, &nbsp;Perbekel Desa Gubug mengucapkan penghargaan kepada Panitia dan pemerintahan Desa serta masyarakat Desa Gubug atas kontribusi dan kerjasama dalam membangun Desa selama ini. dia menekankan pentingnya momentum peringatan ini sebagai waktu untuk introspeksi bersama, mengevaluasi capaian serta merenungkan langkah-langkah ke depan guna menciptakan kondisi yang lebih baik. Sembari mohon maaf Kepada undangan bahwasanya peringatan HUT Desa di tahun ini dilaksanakan&nbsp; secara sangat sangat sederhana sekali. Hal Ini&nbsp; disebabkan oleh kondisi dan situasi saat ini.&nbsp; Dan semuanya tentu adalah bermuara dari perencanaan, karena telah disepakati oleh semua pihak perayaan HUT akan dilaksanakan secara meriah seperti tahun tahun sebelum setiap dua tahun sekali. Tentunya hal ini bukanlah suatu ketetapan/keputusan&nbsp; yang mengikat tapi bisa dievaluasi Kembali.&nbsp; Terkait dengan hal tersebut maka diperlukan &ldquo;Kontribusi pemikiran, ide kreatif, dan nasehat dari masyarakat Desa Gubug sangat berharga dalam perencanaan pembangunan selanjutnya. Perbekel &nbsp;juga menegaskan komitmennya untuk terus mendukung dan mendorong inisiatif-inisiatif yang memajukan kesejahteraan ekonomi bagi semua pihak.</p>\r\n\r\n<p>Acara peringatan HUT Desa ke 103, bukan hanya sekadar seremoni, walaupun dilaksanakan secara sangat sangat sederhana melainkan juga simbol kepedulian dan kebersamaan antara pemerintah desa dan masyarakat setempat.</p>\r\n\r\n<p>&ldquo;Kegiatan ini merupakan bukti nyata dari komitmen bersama untuk memperingati dan mensyukuri berbagai nikmat yang telah diberikan, sambil tetap memupuk semangat kebersamaan,&rdquo; tambahnya. Dengan memberikan bingkisan kepada mantan perbekel dan tokoh yang berjasa terhadap Desa.</p>\r\n\r\n<p>Dalam penutupan sambutannya, Perbekel kembali mengucapkan selamat ulang tahun kepada pemerintah Desa Gubug dan seluruh masyarakat.</p>\r\n\r\n<p>Ia berharap agar langkah-langkah ke depan akan semakin menjadikan desa Gubug sebagai contoh keberhasilan dalam mencapai kesejahteraan bagi semua warganya.</p>\r\n\r\n<p>Ketua BPD, ketut Suetra mengungkapkan rasa bangganya dalam perayaan HUT Desa Gubug Ke 103 ini, pasalnya desa Gubug Baru saja meraih prestasi di tahun 2023 berupa Juara I Lomba desa tingkat Kabupaten, Juara II Lomba desa Tingkat Provinsi Bali, mendapat anugrah dari kementrian HUKUM DAN HAM RI berupa&nbsp; Desa Anubhawa sasana dan Paralegal Justice Award (PJA) dan saat ini dipersiapkan sebagai desa anti Korupsi.</p>\r\n\r\n<p>Satu kebanggaan bagi kami karena Pemerintah Desa telah mempersembahkan kepada kita semua dalam acara HUT Desa Gubug,&rdquo; ucapnya.</p>\r\n\r\n<p>Ia menuturkan bahwa acara ini dapat terselenggara dengan baik berkat peran serta seluruh perangkat Desa dan lapisan masyarakat, sebagai upaya meningkatkan kegiatan-kegiatan pembangunan masyarakat bagi daerahnya.</p>\r\n\r\n<p><strong>@51**</strong></p>', 'pic_1725937832_Screenshot 2024-09-10 110845.jpg', 'perbekel-desa-gubug-dalam-acara-hut-desa-gubug-momentum-refleksi-dan-kolaborasi-BRT-20240910031032', '2024-09-10', '2024-09-10', NULL);
INSERT INTO `tbl_berita` (`kodeberita`, `kodeuser`, `judulberita`, `isiberita`, `gambarberita`, `seoberita`, `created_at`, `updated_at`, `deleted_at`) VALUES
('BRT-20240911025258', 'USER-20220218110402', 'MUSRENBANGDesa Perubahan RPJMDesa, Rencana RKPDesa danDU-RKP', '<p>Musyawarah Perencanaan Pembangunan Desa atau yang lebih dikenal dengan istilah Musrenbangdes yang diselenggarakan tahun 2025 adalah forum musyawarah yang spesifik &nbsp;para pemangku kepentingan (stakeholder) desa untuk menyepakati Rencana Pembangunan Jangka Menengah (RPJMDes) dan Rencana Kerja Pembangunan Desa (RKP) tahun anggaran yang direncanakan. Akibat dari amanat UU Nomor 3 tahun 2025 Perencanaan Pembangunan Desa disusun secara berjangka yakni RPJM Desa untuk jangka waktu 8 (delapan) tahun dan Rencana Pembangunan Tahunan Desa atau yang disebut Rencana Kerja Pemerintah Desa setiap tahun. Musrenbang adalah forum perencanaan (program) yang dilaksanakan oleh lembaga publik yaitu pemerintah desa, bekerja sama dengan warga dan para pemangku kepentingan lainnya. Musrenbang yang bermakna akan mampu membangun kesepahaman tentang kepentingan dan kemajuan desa, dengan cara menggali potensi dan sumber-sumber pembangunan yang tidak tersedia baik dari dalam maupun luar desa. Kegiatan Musrenbang Desa dalam rangka Penetapan perubahan RPJMDesatahun 2020 -2027 dan penetapan skala prioritas RKP Desa Tahun 2025 yang dilaksanakan pada hari Sabtu tanggal 6 September 2024, dihadiri oleh Pemerintah Desa Gubug, BPD, lembaga desa, tokoh masyarakat, , Babinsa, dan unsur perwakilan perempuan.</p>\r\n\r\n<p>Dengan mencermati kebijakan dan program-program yang ada pada Perubahan RPJMDes dan melalui prosedur, akhirnya disepakati program-program apa saja yang menjadi prioritas dan akan masuk ke dalam RPJMDes 2020 -2027 dan RKPDes Tahun Anggaran 2025. Program-program yang tertunda yang tidak dapat dilaksanakan pada tahun anggaran 2024 karena adanya keterbatasan anggaran / penggeseran anggaran yang dipergunakan untuk pemulihan ekonomi masyarakat setelah dampak dari wabah Covid-19 akan menjadi program prioritas dalam RKPDes Tahun 2025. Selain membahas RKP Desa Tahun 2025, kegiatan juga membahas DU RKP Desa Tahun 2026 yang akan dibawa ke forum yang lebih tinggi yaitu Musrenbang Tingkat Kecamatan. Kegiatan berjalan dengan tertib dan lancar.Musrenbang Desa merupakan singkatan dari Musyawarah Perencanaan Pembangunan Desa yang dimana materi Musrenbang Perubahan RPJMDesa 2020-2027 dan RKP Desa 2025 ini merupakan implementasi dari pedoman penyusunan RKPDes Tahun 2025.Secara definisi&nbsp;Musyawarah Perencanaan Pembangunan Desa&nbsp;atau yang selanjutnya disebut Musrenbang Desa adalah musyawarah antara BPD, Pemerintah Desa, dan unsur masyarakat yang diselenggarakan oleh Pemerintah Desa. Musrenbang Desa diatur dalam&nbsp;<strong>Permendes, PDTT No.21 Tahun 2020</strong>. Di samping itu, ketentuan mengenai Musrenbang Desa juga disebutkan dalam&nbsp;<strong>Permendagri No.114 Tahun 2014</strong>.<br />\r\n<strong>@**51</strong></p>', 'pic_1726023178_WhatsApp Image 2024-09-07 at 11.57.52.jpeg', 'musrenbangdesa-perubahan-rpjmdesa-rencana-rkpdesa-dan-du-rkp-BRT-20240911025258', '2024-09-11', '2024-09-11', NULL),
('BRT-20241106035236', 'USER-20220218110402', 'TIM DESA ANTI KORUPSI KPK RI MONITORING UJI PETIK DI DESA GUBUG', '<p>Senin 4 November 2024 tim Desa Anti korupsi dari KPK RI mengadakan monev uji petik ke Desa Gubug, Kecamatan Tabanan, Kabupaten Tabanan.&nbsp; Pada Kesempatan tersebut dihadiri oleh Selain dari KPK RI juga dihadiri oleh Bapak Inspektur Daerah Provinsi Bali, beserta tim penilai Desa Anti korupsi povinsi Bali, Bapak PLT Bupati Tabanan yang diwakili oleh sekretaris daerah Kabupaten Tabanan, Bapak Inspektur Daerah Kabupaten Tabanan, Ibu Kepala Dinas PMD Kabupten Tabanan,&nbsp; Tim pendamping Desa Anti Korupsi Kabupten Tabanan, Ketua BPD Desa Gubug beserta anggota, Babinsa dan Babinkantibmas, Pengurus LKD dan LAD Desa Gubug Serta Tokoh Masyarakat Desa Gubug, bertempat di Ruang rapat Kantor Desa Gubug mulai pukul 09.00 sampai pukul 15.00 Wita.</p>\r\n\r\n<p>Dalam sambutan PLT Bupati Tabanan yang disampaikan oleh Sekda Tabanan mengatakan bahwa kita semua sudah mengerti tentang unsur-unsur korupsi. Kehadiran tim dari KPK RI dan Tim desa anti korupsi provinsi Bali ini tentunya terus memperkuat semangat kita, untuk mewujudkan tata Kelola pemerintahan Desa dan mewujudkan pelayanan terbaik untuk masyarakat Desa dan selanjutnya menjadikan Desa Gubug sebagai contoh sebagai Desa anti korupsi di Kabupaten Tabanan. Kami berharap melalui kegiatan ini agar desa Gubug terus belajar dan berkembang untuk menjalankan praktek-praktek pemerintahan yang bersih serta dapat memperoleh arahan dan bimbingan dari tim KPK RI maupun tim dari provinsi bali. Masukan dan Saran dari Bapak dan Ibu tentunya akan menjadi acuan bagi kami&nbsp; untuk perbaikan kedepan, dan kita sebar luaskan kepada seluruh desa desa kita yang ada di Kabupaten Tabanan yang jumlahnya 133 desa dari 10 kecamatan yang ada di kabupaten Tabanan.</p>\r\n\r\n<p>Selanjutnya Ketua Tim Desa Anti korupsi dari KPK dalam sambutantnya menyampaikan Desa Gubug merupakan salah satu dari 27 desa yang dajukan oleh kabupaten/kota se bali&nbsp; kemudian dipilih satu desa setiap kabupaten/kota oleh tim desa anti korupsi provinsi bali menjadi percontohan Desa Anti Korupsi. &nbsp;Program Desa Anti Korupsi bukanlah perlombaan, melainkan sebuah langkah untuk memastikan semua indikator diresapi, difahami dan diterapkan dengan baik.&nbsp; Ada 5 bidang, 18 idikator dan 79 dokumen yang harus dipenuhi dalam program desa anti korusi. Adapun ke 5 bidang tersebut adalah ; 1. Penguatan tata Kelola, 2. Penguatan pengawasan, 3. Penguatan kualitas pelayanan publik, 4. Penguatan Partisifasi masyarakat dan 5. Penguatan kearipan lokal. Tim KPK RI juga menegaskan bahwa tujuan kedatanganya bukan untuk melakukan penilaian ulang, melainkan untuk memberikan rekomendasi mengenai langkah-langkah ke depan, agar Desa Gubug dapat menjadi percontohan yang baik bagi desa-desa lainnya.</p>\r\n\r\n<p>Setelah acara pembukaan dilanjutkan dengan acara pemaparan profi desa sehubungan dengan penerapan desa anti korupsi oleh Perbekel desa Gubug dan dirangkai dengan&nbsp; diskusi. Setelah itu dilanjutkan dengan kunjungan lapangan yang fokuskan pada program pembangunan fisik di Banjar Tandan penawing,&nbsp; ke Bumdes dan ke tempat pengerajin pande besi di dusun <a href=\"mailto:Pande.**@51\">Pande.&nbsp;</a></p>\r\n\r\n<p><a href=\"mailto:Pande.**@51\">**@51</a><br />\r\n&nbsp;</p>', 'pic_1730865156_SCM00685.JPG', 'tim-desa-anti-korupsi-kpk-ri-monitoring-uji-petik-di-desa-gubug-BRT-20241106035236', '2024-11-06', '2024-11-06', NULL),
('BRT-20241211092852', 'USER-20220218110402', 'KETUA BADAN PEMBINAAN HUKUM NASIONAL (BPHN) KEMENTRIAN HUKUM REPUBLIK INDONESIA KUNJUNGI POSYANKUMHAMDES DESA GUBUG, KECAMATAN TABANAN, KABUPATEN TABANAN', '<p>Kepala Badan Pembinaan Hukum Nasional (BPHN), melakukan kunjungan ke posyankumhamdes Desa Gubug,Kecamatan Tabanan, Kabupaten Tabanan, Provinsi Bali pada Senin (9/12/2024), bertempat di Ruang rapat Kantor Desa Gubug pada pukul 10.30 &ndash; 13.00 WITA. &nbsp;Kunjungan ini bertujuan untuk memantau sekaligus&nbsp; menilai implementasi pos layanan Hukum dan hak asasi manusia (posyankumhamdes) di desa Gubug. Dalam kunjungan ini didampingi oleh &nbsp;Kepala &nbsp;Pusat Pembudayaan dan Bantuan Hukum, Kepala Kantor Wilayah Kemenkumham Bali,&nbsp; Sekrertaris BPHN dan Sejumlah pejabat dari Kemenkumham. Dalam kesempatan tersebut dihadiri juga oleh Sekretaris DPMD Kabupaten Tabanan, Bagian Hukum Kabupaten Tabanan, Camat Tabanan, Perbekel Desa Gubug, BPD desa Gubug, Babinsa dan Babinkantibmas Desa Gubug, Paralegal Desa Gubug, dan sejumlah Tokoh Masyatrakat Desa Gubug. &nbsp;</p>\r\n\r\n<p>Dalam Pertemuan Tersebut Kepala BPHN menyampaikan apresiasi terhadap upaya pemerintah desa Gubug yang telah mengimplementasikan layanan hukum dan Ham untuk masyarakat di desa Gubug. Di tambahkan mengenai pentingnya layanan hukum dan mediasi yang diberikan oleh Posyankumhamdes dalam membantu masyarakat menyelesaikan permasalahan hukum yang dihadapi masyarakat dengan lebih cepat, mudah dan efesien.</p>\r\n\r\n<p>Pos Layanan&nbsp; Hukum dan Ham di desa adalah Langkah yang sangat penting dalam memberikan akses keadilan yang mudah dijangkau oleh masyarakat terutama dipedesaan. Hal ini adalah merupakan wujud nyata dari komitmen pemerintah untuk melayani masyarakat dalam bidang Hukum dan Ham.</p>\r\n\r\n<p>Kepala BPHN juga menambahkan pentingnya keberlanjutan program ini dan peningkatan kualitas pelayanan serta peran aktif dari semua pihak terkait untuk terus menjaga dan mengembangkan Posyankumhamdes agar lebih bermanfaat bagi masyarakat di desa. Saya datang ke desa Gubug adalah untuk memantau dan menerima masukan dari masyarakat secara langsung mengenai dampak Posyankumdes yang telah berjalan sejak tahun 2020. Apakah layanan ini benar- benar memberikan manfaat terutama dalam membantu warga yang mengahdapi masalah Hukum&nbsp; dalam bentuk layanan Konsulatasi, maupun penyelesaian masalah melalaui&nbsp; mediasi.</p>\r\n\r\n<p>Perbekel Desa Gubug menyampaikan terima kasih atas kunjungan dan dukungan BPHN dan motivasi yang diberikan dan kami akan terus berupaya mengembangkan Posyankumhamdes agar dapat memberikan maanfat yang maksimal kepada masyarakat sekaligus mohon kepada Ketua BPHN dan Kanwil Hukum Provinsi Bali agar jangan&nbsp; bosan-bosannya memberikan petunjuk dan arahan serta mendampingi kami.<br />\r\n@51</p>', 'pic_1733909332_WhatsApp Image 2024-12-10 at 10.26.52 (1).jpeg', 'ketua-badan-pembinaan-hukum-nasional-bphn-kementrian-hukum-republik-indonesia-kunjungi-posyankumhamdes-desa-gubug-kecamatan-tabanan-kabupaten-tabanan-BRT-20241211092852', '2024-12-11', '2024-12-11', NULL),
('BRT-20241227021342', 'USER-20220218110402', 'MUSYAWARAH PENETAPAN APBDesa DESA GUBUG, KECAMATAN TABANAN, KABUPATEN TABANAN, TAHUN 2025', '<p>Kamis, 27 Desember 2024. Bertempat di Ruang rapat kantor Desa Gubug Kecamatan Tabanan, Kabupaten Tabanan. dilaksanakan kegiatan Musyawarah Desa Penetapan APBDes Tahun Anggaran&nbsp; 2025. Acara ini dihadiri oleh unsur Pemerintahan Desa; BPD, unsur Lembaga Kemasyarakatan; Babinsa, babinkantibmas serta tokoh Desa Gubug Kecamatan Tabanan</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Musyawarah Desa Penetapan APBDes Tahun Anggaran 2025 merupakan kelanjutan dari perencanaan sebelumnya baik itu Musywarah Desa&nbsp; dan &nbsp;Musrenbangdes adalah proses perencanaan pembangunan desa yang partisipatif, dimana masyarakat desa secara aktif terlibat untuk mendiskusikan, merumuskan, dan menentukan prioritas pembangunan yang akan dilakukan di desa. Tujuannya adalah untuk menentukan arah kebijakan Pemerintah Desa, baik dalam sektor pembangunan, pembinaan, pemberdayaan atapun penyelenggaraan pemerintah yang akan dilaksanakan dalam tahun 2025.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan Musyawarah Desa Penetapan APBDes mengacu pada Permendagri nomor 114 tahun 2014 tentang pembangunan Desa dan Peraturan Menteri Desa, Pembangunan Daerah Tertinggal dan Transmigrasi Nomor 21 Tahun 2020 Tentang Pedoman Umum Pembangunan Desa dan Pemberdayaan Masyarakat Desa dan .Peraturan Mentri Desa Pembangunan Daerah Teringgal dan Transmigrasi Nomor 2 Tahun 2024 tentang Petunjuk Operasional atas Fokus Penggunaan Dana Desa Tahun 2025.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dengan difasilitasi oleh Pemerintahan Desa, Badan Permusyawaratan Desa (BPD),&nbsp; menyelenggarakan Musyawarah Desa dengan melibatkan keterwakilan semua unsur atau komponen masyarakat Desa seperti BPD, TP PKK dan Lembaga kemasyarakatan Desa lainnya,&nbsp;, Bhabinkamtibmas&nbsp; dan atau Bhabinsa, serta unsur Masyarakat lainnya, sesuai kebutuhan Desa.</p>\r\n\r\n<p>Musyawarah Penetapan ini dipimpin oleh Ketua BPD Desa Gubug (I Ketut Suetra). Setelah melalui pembahasan dan diskusi akhirnya Ketua BPD atas Persetujuan dan Kesepakatan bersama menetapkan APBDes Desa Gubug Kecamatan Tabanan, Tahun Anggaran 2025. Mekinime Penetapan sudah sesuai dengan Permendagri Nomor 114 tahun 2014 tentang pembangunan Desa dan Peraturan Menteri Desa, Pembangunan Daerah Tertinggal dan Transmigrasi Nomor 21 Tahun 2020 Tentang Pedoman Umum Pembangunan Desa dan Pemberdayaan Masyarakat Desa , Peraturan Mentri Desa Pembangunan Daerah Teringgal dan Transmigrasi Nomor 2 Tahun 2024 tentang Petunjuk Operasional atas Fokus Penggunaan Dana Desa Tahun 2025.</p>\r\n\r\n<p>Diharapkan dengan penetapan ini akan menjadi acuan rencana kerja di Tahun 2025. Walaupun mungkin dalam musyawarah perencanaan sebelumnya ada penyesuaian jumlah anggaran kegiatan yang di alokasikan ada yang berbeda dengan APBDesa yang ditetapkan. Tentunya Hal ini lagi sekali ditekankan&nbsp; sudah sesuai dengan peraturan perundang-undangan yang telah ditentukan oleh Pemerintah pusat.<br />\r\n@*51</p>', 'pic_1735265622_WhatsApp Image 2024-12-26 at 10.47.33.jpeg', 'musyawarah-penetapan-apbdesa-desa-gubug-kecamatan-tabanan-kabupaten-tabanan-tahun-2025-BRT-20241227021342', '2024-12-27', '2024-12-27', NULL),
('BRT-20250113010243', 'USER-20220218110402', 'PENGANUGRAHAN PENGHARGAAN PERCONTOHAN DESA ANTI KORUPSI TINGKAT KABUPATEN/KOTA DI PROVINSI BALI TAHUN 2024', '<p>Pada hari Kamis, Tanggal 9 Januari 2025, bertempat di Gedung Ksirarnawa, Taman Budaya Art Center Denpasar dilakukan Penganugrahan Percontohan Desa Anti Korupsi &nbsp;tingkat Kabupaten/Kota di Provinsi Bali.&nbsp; Acara ini diinisiasi oleh KPK RI dan yang &nbsp;hadir dalam kesempatan tersebut diantaranya Pj. Gubernur Bali (SM Mahendra Jaya), Forkopimda Bali, Direktur Pembinaan Peran serta Masyarakat Komisi Pembrantasan Korupsi (KPK) (Kumbul Kusdwijanto Sudjadi), Bupati/Walikota se-Bali, Kepala BPK Perwakilan Provinsi Bali, dan undangan terkait lainnya.&nbsp; Kegiatan ini bertujuan memperkuat integritas, meningkatkan tata laksana pemerintahan Desa yang berintegritas dan memberikan pemahaman serta peningkatan peran serta masyarakat desa dalam upaya mencegah dan membrantas korupsi</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Direktur Pembinaan dan Peran Serta Masyarakat KPK RI, Kumbul Kusdwidjanto Sudjadi dalam sambutannya menyampaikan pentingnya sinergitas dalam upaya pemberantasan korupsi, khususnya melalui Program Percontohan <a href=\"https://kabarnusa.com/tag/desa-antikorupsi/\">Desa Antikorupsi</a>. Program ini sudah berjalan di 33 provinsi sejak 2021 dan diharapkan pada periode 2024-2029 dapat ditetapkan di 518 Kabupaten/Kota di Indonesia. &ldquo;Program ini akan berjalan dan terwujud perlu sinergi kita bersama. Sekali lagi KPK tidak mungkin bekerja sendiri kita perlu bersinergi,&rdquo; Pada kesempatan sama Pj. Gubernur Bali Sang Made Mahendra Jaya menyampaikan apresiasinya terhadap seluruh Desa Anti Korupsi Kabupaten/Kota di Provinsi Bali yang telah berhasil ditetapkan sebagai Desa Percontohan Desa Anti Korupsi dan&nbsp; juga mengajak seluruh pihak untuk bersama-sama membangun ekosistem anti korupsi yang kuat untuk kebaikan masyarakat, khususnya Bali.</p>\r\n\r\n<p>Disebutkan, keberhasilan Sembilan <a href=\"https://kabarnusa.com/tag/desa-gubug/\">Desa </a>&nbsp;sebagai Percontohan Desa Antikorupsi, diharapkan menjadi langkah awal untuk menciptakan pemerintahan desa yang bersih dan berintegritas, sekaligus mendukung pembangunan berkelanjutan, bukan hanya di Kabupaten di Desa tetapi juga di seluruh Bali.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Perbekel <a href=\"https://kabarnusa.com/tag/desa-gubug/\">Desa Gubug</a> I Nengah Mawan usai menerima penghargaan menyatakan rasa syukurnya karena <a href=\"https://kabarnusa.com/tag/desa-gubug/\">Desa Gubug</a> melalui perjuangan Panjang akhirnya berhasil terpilih sebagai Percontohan Desa Anti Korupsi tingkat Kabupaten/Kota di Provinsi Bali yang ditetapkan oleh KPK. Penghargaan ini merupakan keberhasilan seluruh masyarakat Gubug melalui perwakilannya seperti; BPD, babinsha, babinkantibmas, LPM, TP PKK, Karang Taruna, Kader posyandu balita, Remaja, Lansia, LAD, Tokoh Agama, Tokoh Masyarakat dan lainya.&nbsp; Penghargaan ini merupakan Langkah awal untuk mencipatakan pemerintahan bersih dan berintegritas, dan selanjutnya semua ini&nbsp; harus dipertahankan dan&nbsp; ditingkatkan, tanpa peran serta dan dukungan dari masyarakat niscaya bisa terwujud.</p>\r\n\r\n<p>@**51</p>', 'pic_1736730163_Picture1.jpg', 'penganugrahan-penghargaan-percontohan-desa-anti-korupsi-tingkat-kabupaten-kota-di-provinsi-bali-tahun-2024-BRT-20250113010243', '2025-01-13', '2025-01-13', NULL);
