('GLI-20231123071049', 'USER-20220218110402', 'MELAKUKAN SOSIALISASI LAPORAN PENYELENGGARAAN PEMERINTAH DESA GUBUG TA 2023 KEPADA MASYARAKAT', 'warga turut menyimak dan memperhatikan laporan penyelenggaraan pemerintah desa gubug tahun anggaran 2023', 'pic_1700723472_WhatsApp Image 2023-11-22 at 14.27.05.jpeg', 'melakukan-sosialisasi-laporan-penyelenggaraan-pemerintah-desa-gubug-ta-2023-kepada-masyarakat-GLI-20231123071049', 1, '2023-11-23', '2023-11-23', NULL),
('GLI-20231211051935', 'USER-20220218110402', 'PEMBAHASAN DAN PENYEPAKATAN RANCANGAN ANGGARAN PENDAPATAN DAN BELANJA DESA (APBDES) TA 2024', 'pada hari jumat, 08-12-2023 Pemerintah Desa Gubug melakukan Musyawarah Desa dalam hal pembahasan dan penyepakatan rancangan anggaran pendapatan dan belanja desa (APBDES) tahun anggaran 2024', 'pic_1702271975_WhatsApp Image 2023-12-11 at 13.02.54.jpeg', 'pembahasan-dan-penyepakatan-rancangan-anggaran-pendapatan-dan-belanja-desa-apbdes-ta-2024-GLI-20231211051935', 1, '2023-12-11', '2023-12-11', NULL),
('GLI-20240127035731', 'USER-20220218110402', 'MUSYAWARAH DESA (MUSDES), LPPD &amp; LPRP-APBDes TA. 2023', 'Pemerintah Desa Gubug Melaksanakan Musyawarah Desa (MUSDES), tentang Laporan Penyelenggaraan Pemerintah Desa (LPPD) dan Laporan Pertanggung Jawaban Realisasi Pelaksanaan Anggaran Pendapatan dan Belanja Desa (LPRP-APBDes) Tahun Anggaran 2023. berlokasi di Aula Kantor Perbekel Desa Gubug, Sabtu 27 Januari 2024.', 'pic_1706327851_WhatsApp Image 2024-01-27 at 09.46.58.jpeg', 'musyawarah-desa-musdes-lppd-amp-lprp-apbdes-ta-2023-GLI-20240127035731', 1, '2024-01-27', '2024-01-27', NULL),
