('PENGADUAN-20231122145814', 'Banyak Anak Muda Kebut Kebutan di Jalan', 'Almira Suartini', 'elisa.uwais@fujiati.biz.id', NULL, 'saya sering melihat anak anak muda, itu pakai motor ugal ugalan di jalan dekat kantor desa, seringkali saya hapir ketabrak, mohon untuk anak anak seperti ini segera diberi peringatan atau bahkan ditindak saja, karena sangat membahayakan masyarakat lainnya.', NULL, 0, '2023-11-22 07:58:14', '2023-11-22 23:22:40', '2023-11-22 23:22:40'),
('PENGADUAN-20231122145815', 'Anjing Liar yang Banyak Berkeliaran, dan Kadang Mengejar Penduduk', 'Hasna Wastuti M.Farm', 'nasyidah.kurnia@gmail.com', NULL, ' ingin menyampaikan keluhan terkait keberadaan anjing liar di lingkungan saya, yaitu di sekitar banjar tonja. Keberadaan anjing liar ini telah menimbulkan beberapa masalah yang memengaruhi kesejahteraan masyarakat setempat, dan bahkan sering mengejar para warga yang bawa motor.', NULL, 0, '2023-11-22 07:58:15', '2023-11-22 23:22:35', '2023-11-22 23:22:35'),
('PENGADUAN-20231122145816', 'Ada Orang Nyetrum di Daerah Sungai', 'Novi Puspasari', 'limar28@yahoo.co.id', NULL, 'saya seringkali melihat ada oknum yang melakukan nyetrum ikan di sungai, mohon untuk pihak terkait segera melakukan penindakan, agar kami warga yang suka memancing, tidak terganggu oleh kehadiran manusia perusak lingkungan seperti itu.', NULL, 0, '2023-11-22 07:58:16', '2023-11-22 23:22:30', '2023-11-22 23:22:30'),
('PENGADUAN-20231122145817', 'Pemulung Masuk ke Rumah Rumah dan Pekarangan', 'Elisa Farida S.Gz', 'lalita52@gmail.co.id', NULL, 'pak saya sering lihat pemulung dan pengemis masuk kerumah rumah, ini agak meresahkan karena kalau tidak dirumah bisa bisa barang kita ada yang hilang.', NULL, 0, '2023-11-22 07:58:17', '2023-11-22 23:22:26', '2023-11-22 23:22:26'),
('PENGADUAN-20231122145818', 'Kegiatan Vaksinasi Hewan Peliharaan', 'Dadi Wahyu Setiawan S.Kom', 'diah.lazuardi@mandala.desa.id', NULL, 'saya sering lihat di beberapa media sosial, itu ada kegiatan vaksinasi gratis, tolong diadakan lagi pak, karena akhir akhir ini sering ada kejadian hewan peliharaan gigit manusia.', NULL, 0, '2023-11-22 07:58:18', '2023-11-22 23:22:19', '2023-11-22 23:22:19'),
('PENGADUAN-20231122145819', 'Informasi Subsidi Pupuk dan Bibit Padi', 'Edi Hardiansyah', 'hilda.haryanto@gmail.com', 'pic_1700666040_sertifikasi.jpg', '<p>kami sangat menginginkan informasi tentang kegiatan subsidi pupuk dan bibit padi, mohon infonya jika ada ya pak.</p>', '<p>ini adalah balasan</p>', 0, '2023-11-22 07:58:19', '2023-11-22 23:22:13', '2023-11-22 23:22:13'),
('PENGADUAN-20231123063741', 'Pavingisasi Jalan Banjar Curah', 'I Gede Made Widana', 'putualitsuartama@gmail.com', 'pic_1700721461_LAPORAN PENGADUAN MASYARAKAT SEMESTER I TH 2023-14-16-1_page-0001.jpg', '<p>Mohon agar pemasangan paving di Banjar Curah di lakukan dengan baik untuk bisa mendapatkan hasil yang maksimal</p>', '<p>Di setujui oleh kepala wilayah dan segera di komunikasikan ke pihak terkait</p>', 1, '2023-11-22 23:37:42', '2023-11-22 23:37:42', NULL);
INSERT INTO `tbl_potensi_desa` (`kodepotensidesa`, `kodeuser`, `kodekategoripotensi`, `namapotensidesa`, `namapemilik`, `alamatpotensidesa`, `keteranganpotensidesa`, `gambarpotensidesa`, `longitude`, `latitude`, `seopotensidesa`, `nohpusaha`, `statuspotensidesa`, `dateaddpotensidesa`, `dateupdpotensidesa`) VALUES
('PTS-20220220113457', 'USER-20220218110402', 'KP-20220220112519', 'Pande Besi Gurun Rian', 'Gurun Rian', 'Br Tonja, Desa Gubug', '<p>Kamu bisa membeli topeng ukir khas Bali untuk dijadikan oleh-oleh. Topeng ukir Bali memiliki banyak macam bentuk dan ekspresi, mulai dari wajah manusia hingga makhluk spiritual. Tidak hanya unik, proses pembuatan topeng ukir Bali juga tidak mudah. Para prajin harus mengukir ekspresi wajah pada topeng-topeng tersebut dengan teliti. Topeng ukir Bali dapat dibeli di berbagai pasar seni dan toko oleh-oleh Pulau Dewata.<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href=\"https://www.kompas.com/\">Kompas.com</a>&nbsp;dengan judul &quot;5 Oleh-oleh Kerajinan Khas Bali, Ada Topeng sampai Sabun&quot;, Klik untuk baca:&nbsp;<a href=\"https://travel.kompas.com/read/2021/09/11/160400327/5-oleh-oleh-kerajinan-khas-bali-ada-topeng-sampai-sabun?page=all\">https://travel.kompas.com/read/2021/09/11/160400327/5-oleh-oleh-kerajinan-khas-bali-ada-topeng-sampai-sabun?page=all</a>.<br />\r\nPenulis : Aziza Zahwa Layla Madjid<br />\r\nEditor : Anggara Wikan Prasetya<br />\r\n<br />\r\nDownload aplikasi&nbsp;<a href=\"https://www.kompas.com/\">Kompas.com</a>&nbsp;untuk akses berita lebih mudah dan cepat:<br />\r\nAndroid:&nbsp;<a href=\"https://bit.ly/3g85pkA\">https://bit.ly/3g85pkA</a><br />\r\niOS:&nbsp;<a href=\"https://apple.co/3hXWJ0L\">https://apple.co/3hXWJ0L</a></p>', 'pic_1645356897_sub_coffe-making-process-bali-360x240.png', '', '', 'pande-besi-gurun-rian-PTS-20220220113457', '08477599473', 1, '2022-02-20', '2022-04-07');
