INSERT INTO `tbl_video` (`kodevideo`, `kodeuser`, `judulvideo`, `urlvideo`, `keteranganvideo`, `seovideo`, `created_at`, `updated_at`, `deleted_at`) VALUES
('VID-20230424081835', 'USER-20220218110402', 'PAK HAJI DI SEREMPET KADAL | SPESIAL BULAN RAMADHAN', 'AN5injRlvzY', '<p>Pemerintah dan Masyarakat Desa Gubug mempersembahkan video pendek spesial Bulan Ramadhan. Selamat Hari Raya Idul Fitri, Minal Aidin Wal Faidzin, mohon maaf lahir dan batin.</p>', 'pak-haji-di-serempet-kadal-spesial-bulan-ramadhan-VID-20230424081835', '2023-04-24', '2023-04-24', NULL),
('VID-20230426115839', 'USER-20220218110402', 'VERIFIKASI & PENINJAUAN LAPANGAN BAGI CALON PENERIMA PENGHARGAAN SATYALANCANA PEMBANGUNAN', 'z_ZetxA7hzk', '<p>Team Persentasi Verifikasi &amp; Peninjauan Lapangan atas usulan Bupati Tabanan sebagai calon penerima penghargaan Satyalancana Pembangunan dari Presiden Republik Indonesia. Penghargaan akan diserahkan oleh Presiden pada pelaksanaan PENAS XVI di Padang, Sumatera Barat, pada tanggal 10 Juni 2023.</p>', 'verifikasi-peninjauan-lapangan-bagi-calon-penerima-penghargaan-satyalancana-pembangunan-VID-20230426115839', '2023-04-26', '2023-04-26', NULL),
('VID-20230426115924', 'USER-20220218110402', 'REVIEW UMKM NASI LAWAR KELUNGAH | PODCAST DESA GUBUG', '0AyQhi6MTUg', '<p>Banyak warga Desa Gubug yang bergelut di bidang usaha UMKM / IKM, kali ini Podcast Desa Gubug mengundang pelaku UMKM Nasi Lawar Kelungah, Paon Biang Alit dan kami sekaligus melakukan Review terhadap produk UMKM tersebut.</p>', 'review-umkm-nasi-lawar-kelungah-podcast-desa-gubug-VID-20230426115924', '2023-04-26', '2023-04-26', NULL),
('VID-20230426120008', 'USER-20220218110402', 'Peran & fungsi POSYANKUMHAMDES untuk Masyarakat Desa Gubug | PODCAST DESA GUBUG', 'KYst1PwdRsw', '<p>POSYANKUMHAMDES merupakan lembaga kemasyarakatan Desa yang bergerak khusus di bidang pelayanan hukum bagi Masyarakat Desa. Bantuan hukum yang dapat diberikan kepada orang miskin / kelompok orang miskin secara cuma-cuma, bantuan hukum yang diberikan diantaranya : 1. Penyuluhan &amp; pelatihan Hukum 2. Pemberdayaan Masyarakat 3. Konsultasi Hukum 4. Mediasi 5. Negoisasi 6. Pendampingan di luar Pengadilan (Non Litigasi) Untuk info lebih lengkap, saksikan video ini sampai selesai. Terimakasih</p>', 'peran-fungsi-posyankumhamdes-untuk-masyarakat-desa-gubug-podcast-desa-gubug-VID-20230426120008', '2023-04-26', '2023-04-26', NULL),
('VID-20230426120051', 'USER-20220218110402', 'KERIS ADALAH IDENTITAS DAN JATI DIRI | JRO MARGI KERIS | PODCAST DESA GUBUG', 'xSHd9iSBNZ8', '<p>Om Swastyastu.. Di Podcast Desa Gubug kali ini kami mendatangkan seorang praktisi dan sering menjadi narasumber di Bali bahkan di luar Bali untuk membahas tentang Keris. banyak yang kita belum pahami mengenai Keris dan banyak terjadi kekeliruan tentang bagaimana kita memahami Keris. Jadi mari kita simak video ini bersama-sama agar kita bisa lebih paham mengenai Keris.</p>', 'keris-adalah-identitas-dan-jati-diri-jro-margi-keris-podcast-desa-gubug-VID-20230426120051', '2023-04-26', '2023-04-26', NULL),
('VID-20230426120727', 'USER-20220218110402', 'BUMDesa Bersama Dwi Dasa Amertha memfasilitasi tumbuh kembangnya UKM & IKM di Kecamatan Tabanan', '8Ansp2Mgq28', '<p>PODCAST Desa Gubug kali ini menghadirkan narasumber dari BUMDesa Bersama Dwi Dasa Amertha Kecamatan Tabanan, menyampaikan terkait program pengentasan kemiskinan di Kecamatan Tabanan, melalui penyaluran kredit tanpa agunan dan bunga rendah untuk para UKM &amp; IKM di Kecamatan Tabanan.</p>', 'bumdesa-bersama-dwi-dasa-amertha-memfasilitasi-tumbuh-kembangnya-ukm-ikm-di-kecamatan-tabanan-VID-20230426120727', '2023-04-26', '2023-04-26', NULL),
