('VID-20230515080249', 'USER-20220218110402', 'ASAL USUL TERBENTUKNYA KARAKTER SENGAP DI CELEKONTONG MAS | PODCAST DESA GUBUG', 'AAuRk88MoLg', '<p>berjumpa kembali di Podcast Desa Gubug &quot;Dari Gubug Membangun Bangsa&quot; di video kali ini kita kedatangan tamu istimewa, salah satu punggawa di Sekaa Lawak Bali Celokontong Mas yaitu Jro Sengap Jaya. banyak pembahasan seru dan lucu di perbincangan kita kali ini, namun ada juga pembicaraan insfiratif dari Jro Sengap. salah satunya kita membahas asal usul terbentuknya karakter Sengap di Celekontong Mas. mohon dukungannya dengan cara like, komen, dan subscribe channel Desa Gubug TV. Terimakasih</p>', 'asal-usul-terbentuknya-karakter-sengap-di-celekontong-mas-podcast-desa-gubug-VID-20230515080249', '2023-05-15', '2023-05-15', NULL),
('VID-20230515080331', 'USER-20220218110402', 'TUTORIAL LAWAR BIU BATU DAN OLAHAN DARI HASIL KEBUN DESA GUBUG | MASAKAN JEJAK I MADE', 'UD0PJfJrorM', '<p>Salam dari Gubug membangun Bangsa !!! di video ini Kantor Desa Gubug melakukan acara bersih bersih lingkungan Kantor, lalu dilanjutkan dengan acara makan siang bersama dengan mengundang Konten Kreator Kuliner yaitu Jejak i Made yang dikenal dengan jargonnya Kabyaah, untuk masak di Kantor Desa Gubug sekaligus membuat konten dengan Menu Lawar biu batu dan beberapa masakan hasil dari kebun Desa Gubug. di video ini berisi kata kata khas dari Kabyah dan sudah melalui ijin dari Perbekel Desa Gubug.</p>', 'tutorial-lawar-biu-batu-dan-olahan-dari-hasil-kebun-desa-gubug-masakan-jejak-i-made-VID-20230515080331', '2023-05-15', '2023-05-15', NULL),
